    'template': '1'
    'title': 'Advocates support mental health act'
    'updated': 2017-05-04T03:37:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '86a799d5-e741-4b07-9cce-69e894e51b8f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.047+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.294+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3) —</strong> With the
        Mental Health Act already passed in the Senate, advocates are voicing out
        their support for the measure.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd043a066-ead0-4705-abc4-de24653a54d2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.047+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.294+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd3aae501-fda0-4ecb-9768-52a75a42dbb9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.295+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Among the advocates is Miss International 2016 Kylie Verzosa, who
        opened up about her personal experience.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b0c20538-bca5-4987-84b6-c6f6dd036774'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.295+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0df345ee-9d41-4ad5-8945-7e1195e0164f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.295+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/lifestyle/2016/11/14/Miss-International-Kylie-Verzosa-advocates-mental-health.html"><strong>Miss
        International Kylie Verzosa had depression – and is now a mental health advocate</strong></a></p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '165d191b-2a55-4649-ab9a-35b78b9cbc4e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.296+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5e559abb-1bfb-445e-94fe-46fda35f27d8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.296+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I went through so much pain and I am a proud survivor of it and
        those who suffered and fought should not have been left in vain," Verzosa
        said.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '992e5e4d-5cb0-473d-80d4-e75bd67c5923'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.296+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '26167477-756b-412a-ba3a-c77bcda4994e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.297+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senate Bill No. 1354, or the Mental Health Act of 2017 was passed
        on third and final reading on Tuesday, with 19 affirmative votes, zero negative
        votes, and no abstentions.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f7a63ad8-76b9-4693-b771-bda7113a9db8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.297+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e101942a-c677-466e-bb49-e4645320cf2e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.297+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/05/02/senate-passes-mental-health-act-third-reading.html"><strong>Senate
        passes Mental Health Act</strong></a></p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9669eb04-dbdc-4469-a90a-e5d5a7d9d310'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.048+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.298+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '06b9aca2-8e95-41c9-8d35-92d59404c4ed'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.298+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The bill seeks for the government to put up basic mental health
        services at the community level and psychiatric, psychosocial and neurologic
        services in all regional, provincial and tertiary hospitals.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '979355d4-357d-4e87-bbaf-c2afefd31da1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.298+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f8afdf84-9e96-45e1-9a5a-b50ed1cc82fb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.299+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"<em>Sa pamamagitan po nitong</em> mental health act, <em>magkakaroon
        tayo ng</em> stronger mechanisms <em>para siguruhin ang proteksyon ng karapatan
        ng mga indibidwal na nagsu</em>-suffer <em>sa</em> mental health conditions,"
        said Senator Risa Hontiveros, the sponsor and principal author of the bill.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fe8ff53a-477b-4ebc-8dbf-c2c445f24552'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.299+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5600fcf5-0fd2-41f5-b5f8-7cc589cc179e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.299+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: Throught the mental health act, we will have stronger
        mechanisms to ensure that the rights of each individual suffering mental health
        conditions are protected.]</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '991f38ac-61ac-479d-ac48-64b6ab073098'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.299+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1abf010f-2967-46ea-830d-b469a555966d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.300+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Authors of the measure said that mental health services should not
        only limit to mentally-ill people but for everyone.</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '929b5d9a-c9ea-4bd1-96cd-f6ac7736220a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.300+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2aeff7e3-2333-4aac-a556-e89f89dc5ec5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.300+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"<em>Etong magiging batas ay para turuan ang ating publiko tungkol
        sa</em> mental health, <em>para mabawasan ang</em> stigma <em>at diskriminasyon
        sa pag</em>-integrate <em>ng</em> mental health <em>sa</em> school curriculum,
        <em>at pag</em>-mainstream <em>ng</em> mental health program <em>sa mga</em>
        academic institution <em>at sa mga</em> workplaces," added Hontiveros.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3b035419-b80f-41da-9ed3-86dfa9ce977a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.301+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '47a24b62-776a-44e5-9f6d-cdade1a1cec9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.049+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.301+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: This eventual law is to educate the public about mental
        health, to lessen the stigma and discrimination in integrating mental health
        in the school curriculum, and to mainstream mental health programs in academic
        institutions and workplaces.]</p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '300ae78c-4181-4ff7-ab72-5cbfdb904c2b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.301+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fd7ae124-f053-4bc7-b43c-0c0ecfd0d1be'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.302+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The Health department said one out of five Filipino adults have
        some form of mental illness, like schizophrenia, depression, and anxiety.</p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '40aca331-8224-4375-9378-bd9c757bb7f5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.302+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8b588d71-b50a-424c-8fa9-5cac853fec59'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.302+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>One such example is 52-year old Frances Bretana, who used to suffer
        from depression during her teenage years.</p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'abb32d55-80c9-48e2-aa6d-f542b15100a0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.303+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5d4d36dd-9a0c-4d2d-9e27-28717130dd4c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.303+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I never sought long term help because i thought after going through
        counseling or a short period of time you feel good <em>na</em> (you already
        feel good)…okay <em>ka na</em> you feel good about yourself and you feel back
        on your feet," Bretana said.</p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '17b26a07-bc4a-4c01-8d8d-7c5d2cd5a79c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.303+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9d39ee39-aaef-49b5-920e-0d6096d0811d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.304+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>She feels leaving the condition untreated for so long led to a bipolar
        disorder and it was only 12 years ago when she found out about her condition
        after seeking a medical intervention.</p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c6c39da3-c690-40c6-b7d0-567e5e5b73d4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.304+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8540743c-4725-491b-b00c-137796abc30d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.050+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.304+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"It was a big relief because after having found out that I was bipolar
        2, then me and my family could take on the necessary medical steps," Bretana
        added.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '11a978ae-e410-4d98-bca7-c331d0c6cb21'
