      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '968fcfd0-1618-4a01-8b3f-50ea4a222044'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:06:19.051+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:06:19.305+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Mental health supporters said they may be victorious at the Senate,
        but the battle hasn''t ended yet as they are still pushing for a counterpart
        bill at the House of Representatives.</p>'
  'xi-jinping-calls-duterte':
    'author': 'CNN Philippines Staff'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T21:03:22.612+08:00
