    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': '061ef60b-f3b8-4dff-a2f7-3071e1882e1e'
    'lead': 'Duterte received the call and thanked the Government of China for inviting
      him to tour the warship that docked in Sasa Wharf.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:09:06.918+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:09:07.069+08:00
