    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Xi Jinping phones Duterte, thanks him for navy vessel tour'
    'updated': 2017-05-04T09:00:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '93bac57f-c7ce-424a-9e3d-719e0d729625'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.070+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN Philippines, May 3)</strong> — President Rodrigo Duterte
        received a phone call from Chinese President Xi Jinping on Wednesday afternoon,
        wherein he thanked China for inviting him to tour the warship "Chang Chung"
        last Monday.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9f14f33e-1766-403d-81b1-62f9ef63cbda'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.070+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '045c8dda-d635-4f86-af5e-e4b6e68447fd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.071+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/05/01/Duterte-very-impressed-Chinese-warship.html"><strong>Read
        more: Duterte impressed with Chinese warship, open to joint drills</strong></a></p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9500fffa-a284-4f64-a33e-7ea3c39c4c45'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.071+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '575dba06-5e89-45f9-ae6b-143c6856e12d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.071+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>According to DFA Spokesperon Robespierre Bolivar, Duterte and Xi
        had a very cordial conversation.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5c3d3f74-9dfd-4a03-a1a0-ae3e6c496f4b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.072+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9bd08a02-064e-4fba-8112-b16ba7ebc385'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.072+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In a statement, Bolivar said Duterte shared Philippines'' stand
        on tensions in the Korean Peninsula, emphasizing China''s important role in
        promoting peace in the area.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bd8a1252-a6d0-4a14-bc46-c863e4784e5f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.072+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9b20f780-6618-4712-92cb-00c36b175c1b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.919+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.073+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In his capacity as Chair of ASEAN, the President spoke about how
        to further strengthen ties with ASEAN''s dialogue partners and shared the
        outcomes of the recently concluded successful ASEAN summit.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'db5be3c9-900f-4f8a-b17c-a7a784e18617'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.920+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.073+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fac48a6f-fdac-4c7d-85f9-cda5c1555590'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.920+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.073+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"He also mentioned that as the Chair of ASEAN, ASEAN discussed and
        agreed on measures to promote ASEAN unity, centrality and solidarity as well
        as ASEAN commitment to continue promoting peace and stability in the Asia
        Pacific region," Bolivar said.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '40eb6600-ab87-4482-81fb-bbdcaa02ee37'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.920+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.073+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '02d7d55a-bf72-421a-a5db-617fe500ff5c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:09:06.920+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:09:07.074+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Duterte drew criticisms after the Chairman''s statement was toned
        down to avoid referrence to the arbitral ruling that voided China''s sweeping
        claim in the South China Sea.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '704dbd32-fe5e-47fd-a7ea-4260e47ac2d2'
      'mgnl:activationStatus': true
