    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'e968df70-0930-4cf0-aa39-5b772c02fb45'
    'lead': 'Malacañang has suspended Energy Regulatory Commission (ERC) Chairman
      Jose Vicente Salazar over various administrative charges.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:16:38.628+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:16:38.804+08:00
