    'title': 'Palace suspends ERC chair Jose Salazar'
    'updated': 2017-05-04T19:58:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5862a3bd-9698-4a6d-9aa1-e13cabc552b4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.628+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.805+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN Philippines, May 3) —</strong> Malacañang has suspended
        Energy Regulatory Commission (ERC) Chairman Jose Vicente Salazar over various
        administrative charges.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b6ed7fec-263d-4812-b28b-f085516baff9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.805+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '43acbbbe-cd31-42b4-bbb5-c3fecfb3904d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.805+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In an order dated May 2, Executive Secretary Salvador Medialdea
        placed Salazar under preventive suspension for a period of 90 days, effective
        immediately.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e94d8c0-7bb2-49cc-8a73-b7814f96b73e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.806+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f816f7e1-19e4-46e8-a77e-ce4255b7ca6e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.806+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Salazar is facing administrative charges – serious dishonesty, gross
        neglect of duty, grave misconduct, gross insubordination, violations of the
        Government Procurement Reform Act, Anti-Graft and Corrupt Practices Act, and
        Code of Conduct and Ethical Standards for Public Officials and Employees among
        others</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '55c7bea3-7e8b-4c4d-9aa4-7a35334ac568'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.806+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '660b3989-dfbe-40c7-bed6-c59f92bd59e5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.806+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/04/06/erc-complaint-irregular-appointments.html"><strong>Read:
        Exclusive: ERC chief to face complaint over irregular appointments</strong></a></p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4505aef7-b074-41cc-82d5-59415fc71e8e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.807+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1bb36f9f-64e7-495e-b33c-7bfb283e7713'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.807+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Medialdea said "examination of the records reveals that there exists
        a prima facie case against Chairman Salazar on the above-stated charges."</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '751e3cfd-ed8f-4ff7-bc3c-ff759e617999'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.807+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ab671bf2-0fbc-4a17-81d7-8370e810f866'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.808+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Salazar was given 10 days to file his comment or written explanation
        regarding the administrative charges.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ac7d9643-6ea1-44d3-97b4-a13ae3be79a2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.629+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.808+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2de6b5c5-b21a-4534-a2e2-406cac1d9b42'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.630+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.808+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>If proven guilty of the charges, Salazar can be removed from office.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '05d00636-b947-4d85-8ed7-b540a6dee301'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.630+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.809+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4d8bee71-7683-46f5-921e-c23a27761ff1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.630+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:16:38.809+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Medialdea said the reason behind Salazar''s suspension was to prevent
        him from influencing the outcome of the investigation against him.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'af715753-32b5-45ac-bb13-5c1a366584c4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:16:38.630+08:00
