  'filipinos-trust-us-not-russia-china':
    'author': 'CNN Philippines Staff'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T18:46:06.405+08:00
    'imagesource': 'jcr:2baf7bd5-f2d0-4861-8f27-de789fab31f7'
