    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '65e41b61-8488-4882-8b4e-7526fc2a602b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:19:04.631+08:00
      'mgnl:createdBy': 'eunice'
