      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3)</strong> — America
        remains one of the countries most trusted by Filipinos, while more than half
        of Filipinos distrust Russia and China, a private pollster reported Tuesday.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '672b13d3-4034-4dcf-a3cd-31570efe3ecb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:19:04.631+08:00
