      'mgnl:lastActivated': 2019-07-17T10:19:07.141+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c86a5687-5832-4c26-b37a-8d4f62b2ef68'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:19:04.631+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:19:07.141+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>According to Pulse Asia''s <em>Ulat ng Bayan</em> report, 79 percent
        of the 1,200 survey Filipino respondents trust the United States, which ranked
        the highest among the six countries included in the survey.</p>'
    '3':
