      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Pulse Asia reported trust ratings for Russia and China among Filipinos
        only logged 48 and 37 percent, respectively-- the lowest of the six countries
        in the poll.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
