  'social-weather-stations-survey-hunger-down-q1-2017':
    'author': 'Pia Garcia, CNN Philippines'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T18:16:40.730+08:00
    'imagesource': 'jcr:c5ced0a6-c14e-4286-860d-142f3db17b41'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'c6df4825-3298-44f4-88f9-64bcc6623b6c'
    'lead': 'A survey released by the Social Weather Stations showed a decline in
      the number of families who experienced hunger in the first three months of 2017.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:28:56.560+08:00
