    'template': '1'
    'title': 'Fewer families were hungry in Q1 — SWS'
    'updated': 2017-05-04T03:36:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'db776467-f68e-4a5e-84b6-0a73a963eb30'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.898+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3)</strong> — Fewer Filipino
        families went hungry in the first quarter of 2017.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4ab0c6cb-20e6-4eaa-b2e2-f9ce20e6f255'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.899+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '77f9e80f-9068-475e-a627-1a95a2ea514f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.899+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>This, according to the Social Weather Stations (SWS), who asked
        1,200 people whether they experienced involuntary hunger during the period.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f7a2a10f-5736-43fe-8e7b-fb56ee46d9a3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.899+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '74079a29-3912-403a-ae93-783ff2e29e5a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.900+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>SWS defines involuntary hunger is experienced when there is a lack
        of food to eat.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5d17b9cc-05a7-4d2e-a7b8-b78ccc4b937a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.900+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f2390d06-6291-46ba-8ea7-eaf0e6d42572'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.900+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Respondents were asked, "<em>Nitong nakaraang tatlong buwan, nangyari
        po ba kahit minsan na ang inyong pamilya ay nakaranas ng gutom at wala kayong
        makain</em>?"</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2462d377-6ff7-4d95-a8f7-43b192e5b3c0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.561+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.900+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7e64b7d6-b847-4b9c-969b-52f04c098d33'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.901+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: In the last 3 months, did it happen even once that
        your family experienced hunger and not have anything to eat?]</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ab0e31f9-8813-4875-aaf7-ab088d1a9959'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.901+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5b530293-a771-4f77-8118-91f3b8d7d965'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.901+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Those who experienced hunger were further asked: "<em>Nangyari po
        ba ''yan ng minsan lamang, mga ilang beses, madalas, o palagi</em>?"</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c8d28982-2034-4a60-9c01-c5c08e732cf9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.902+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1eafb28e-57b9-4584-9109-8f86f27437b0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.902+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: Did it happen only once, a few times, often, or always?]</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '85b063f2-fa08-4880-ac32-d88ace0d2316'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.902+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e0ffafea-5d05-41f6-b079-aa56d37917ae'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.902+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The survey showed 11.9 percent – an estimated 2.7 million households
        – experienced involuntary hunger at least once.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1b38eda1-22e8-4c80-b048-b24463ae3572'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.903+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51b6f5fa-85d7-40f9-97ca-e0c522d1574d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.562+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.903+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>This number is two points lower compared to a similar survey conducted
        in December 2016. That time 13.9 percent or around 3.7 million families reported
        involuntary hunger.</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '68f676ef-fc82-4d8f-964d-41233491156f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.903+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5a5a2d5a-e835-4ea3-a6de-df2e2f580544'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.903+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In the same period last year, 13.7 percent reportedly did not have
        enough food to get by at least once.</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '703bd43e-72d8-4595-b29c-d0104af43619'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.904+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '52ecdbb9-ba68-4ac0-a8fb-fee7451230fb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.904+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>SWS said, "The survey questions about the family''s experience of
        hunger are directed to the household head."</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fd5464de-377b-4f31-85dd-18942873853d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.904+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0526c538-8807-43e3-b06e-1109ea0b8a86'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.905+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The survey was conducted from March 25 to 28.</p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ba7d3420-f420-4807-b622-9052cb419dd3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.905+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '78e46c98-cb72-4904-b22e-db5291015cd9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.905+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Abella: Lower numbers are proof of admin''s success</h2>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b5728e64-33bc-4fff-9d59-cfa56389083a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.563+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.905+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Presidential Spokesperson Ernesto Abella was quick to declare that
        the decline in the number of hungry Filipinos "affirms the positive impact
        of the Duterte administration''s poverty alleviation efforts on the lowest
        rung of society."</p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '79962454-e99f-4ea4-94e2-a3b0bed50a7b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.906+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2cf2ba7c-0a4d-4f9a-82b1-0937e3db4522'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.906+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He added, "Some of the government''s immediate pro-poor and inclusive
        efforts include social protection to the poor, the marginalized and the neglected
        sectors, such as conditional cash transfer to the poorest of the poor, higher
        pension for seniors, free medicine for indigents, added incentives and combat
        duty pay for police and soldiers, gratuity pay to job order and contract workers
        in the government and regularization of tens of thousands of employees."</p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51e417e7-7c24-4aae-b24f-c6a59f8610e7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.906+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '80d38c67-5550-4be7-a224-ecce95f47dfe'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.907+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The government''s long-term goal, however, is to improve the lives
        of Filipinos across sectors, through effective delivery of goods and services,
        like increased spending in infrastructure projects and the promotion of easy
        access microfinancing system," he said.</p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6f76cdf1-a3e4-4851-a32d-61d74a070707'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.907+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5263dab7-f99c-45e6-8d1d-aaad1088d05d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.907+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>The fight against malnutrition</h2>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2f39dcab-46e4-4491-9128-a2564d2becfc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.908+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The SWS survey comes at the heels of the launch of the Philippine
        Plan of Action for Nutrition (PPAN) 2017-2022 on Tuesday.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3de59b94-bd1e-4cf1-9230-9283391b8eef'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.908+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'baacef33-fab5-41d0-aca0-dfe8b3b4718a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.908+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The program is an initiative by the Department of Health and the
        National Nutrition Council, the PPAN 2017-2022 serves as a blueprint for nutrition
        intervention in the Philippines.</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2f835ad9-dfe3-4845-b003-56ef805e7ef1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.564+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.908+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5adc93f6-fcf1-4d5b-956a-a50369fb1ca2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.909+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/05/02/DOH-blueprint-for-nutrition.html"><strong>Read:
        DOH launches blueprint to curb nutrition deficiencies among Filipino children</strong></a></p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8ca0305a-168a-4d61-98d6-08624fecceb4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.909+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'efa3505c-8bcc-40a9-9ffb-9299d551b88e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.909+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In a 2015 study by the Food Nutrition Research Institute of the
        Department of Science and Technology, 21.5 percent of Filipino children under
        five are experiencing undernutrition, caused by lack of food or substances
        necessary for growth and health.</p>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a75c4552-8286-496f-b5e1-a499bd4528f1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.910+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7a4f3ff8-3821-48f8-ad5f-2f17dff37236'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.910+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Apart from infants, young children, and mothers - including those
        from indigenous communities and far-flung areas – are part of the PPAN roadmap.</p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51b162cc-7f52-445e-9a67-35b1ea1ca593'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.910+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c1893489-5f5d-4584-860f-43ff5f2e70b4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:28:56.565+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:28:56.910+08:00
      'mgnl:lastActivatedBy': 'eunice'
