      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><em>CNN Philippines'' Chad de Guzman contributed to this report.</em></p>'
  'first-coworking':
    'author': 'Don Jaucian'
    'caption': 'First Coworking Community is workplace with open-planned interiors
      has room for 36 working people but can accommodate up to 60 people for events.
      It is open for everyone interested in working in a different environment, especially
      for freelancers and startups. Photos by JL JAVIER'
    'categories': ['bf00e680-8020-4f85-954e-e242450f836b']
    'created': 2017-05-03T18:43:06.542+08:00
    'imagesource': 'jcr:b4268032-04f3-447a-9bc5-c9a59ce79ede'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': '81ad15e3-0e0b-4f05-b881-d9689f187426'
    'lead': 'First Coworking Community is a new space in Old Manila’s Escolta. Primed
      as a creative playground, the coworking place is part of the efforts to revitalize
      the creative community along the historic street'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:35:19.707+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:35:19.919+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Meet your cool new office in the heart of downtown Manila'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '217aa034-4495-4db7-835f-dc33af3c94cb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.707+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.919+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Manila (CNN Philippines Life)</strong> — One of the overarching
        realities of working life is that an average person will spend most his waking
        hours in the office instead of with their families or at their homes. This
        fact might have a chilling effect on some people, conjuring an image of a
        buttoned-up office drone chained to their desk for eight hours, but there
        have been numerous efforts to revitalize the office as a space for creativity
        rather than a sterile environment just for crunching numbers and meeting metrics.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1c46ecb3-a00d-4ccc-821e-7edc2747e414'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.707+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.919+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '946ada2b-d609-4dcf-87a2-ba7e0ab9a7b1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.707+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>This is what First, a new co-working space in Old Manila’s Escolta
        street, is trying to address: priming the workplace as a harmonious combination
        of exciting creative growth and productivity.</p>'
    '3':
      'image': 'jcr:3adc511c-2d62-4e3b-9116-ac06defc9def'
      'imageCaption': 'The space is flexible enough not to be designated for use solely
        by individuals or groups. You can pick one corner if you prefer privacy or
        groups can occupy shared desks and tables if they want to work more collaboratively.
        Photo by JL JAVIER'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '039dae3b-094c-41c0-aa71-97f5dcd5280b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.707+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'image'
    '4':
      'image': 'jcr:e8cc246d-c745-4236-95f8-fb1b8d1aca57'
      'imageCaption': 'The lower part of the space can be re-arranged to accommodate
        functions and events like talks and discussions. Photo by JL JAVIER'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd597a84f-7aa8-4c97-8bdd-faa4f9c7d6ed'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'image'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6f813a73-209c-4efc-a070-259eada8fd03'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Wide, floor-to-ceiling windows frame the historic structures of
        the street, placing the space in a historic context, as if to say that what
        you’re making on your laptop will someday be part of history. On a dreary
        late afternoon, when office fatigue usually sets in, the presence of natural
        light illuminating the desks makes working all the more bearable.</p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6dd0185b-3bfc-43c4-950f-1b6a9ba77cd0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4040d4eb-1ded-40d1-b704-ee98d058bcd9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The coworking space is a logical trajectory for the First United
        Building as a creative hub. The building has enjoyed a renewed growth since
        the opening of 98B COLLABoratory’s business incubator, <a href="http://cnnphilippines.com/life/culture/businesslife/2016/05/27/hub-make-lab.html">Hub:
        Make Lab</a>, and the addition of the coffee shop, The Den, and the drinking
        fixture, Fred’s Revolucion, all within a span of a few months in 2016. The
        co-working space furthers the creative ecosystem of the community.</p>'
    '8':
      'image': 'jcr:7198ce0b-d1f8-4aee-8bc3-3b4e2ed1bbbe'
      'imageCaption': '“First is a showcase of how progressive Escolta can be with
        the help of creative thinkers and startups in the hopes that it can draw a
        revived attention to the potentials of locating not just the First United
        Building, but also other buildings along Escolta and maybe other districts,”
        says architect Angelo Ray Serrano. Photo by JL JAVIER'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '57b33653-0c04-4f5e-bf2f-f11fce995df7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'image'
    '9':
      'image': 'jcr:b95bfe49-26f6-46c5-8c9b-06d29ecdf288'
      'imageCaption': 'Wide, floor-to-ceiling windows frame the historic structures
        of the street, placing the space in a historic context, with views of neoclassical
        buildings Regina and Roman Santos and Leandro Locsin modernist, Syvel’s. Photo
        by JL JAVIER'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fbfcf536-2eb8-4849-9400-0231dc2b6a11'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'image'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6c44f583-f091-441c-a393-3358e7d7551f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>“It is part of an overarching effort by Robert and Lorraine Sylianteng
        to present their spaces to artists, startups, and creatives,” says architect
        Angelo Ray Serrano of <a href="http://cnnphilippines.com/life/culture/businesslife/2016/05/25/escolta-office.html">One/Zero
        Design Collective</a>. First is a collaboration between the Syliantengs, One/Zero,
        and the brand agency <a href="https://cnnphilippines.com/life/style/design/2017/01/11/public-school-manila-office.html">The
        Public School Manila</a>, the latter being two creative firms who have called
        Escolta their home.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3194324b-1ea9-4890-a6a0-a1888f3c5497'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '130edd5e-f6f9-4fb0-a928-2ad8d102f6e3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.708+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>“First is a showcase of how progressive Escolta can be with the
        help of creative thinkers and startups in the hopes that it can draw a revived
        attention to the potentials of locating not just the First United Building,
        but also other buildings along Escolta and maybe other districts,” Serrano
        adds.</p>'
    '14':
      'image': 'jcr:ccbbbe3d-1681-4f68-9725-5341c0529c9b'
      'imageCaption': 'A branding material for First Coworking Community by The Public
        School Manila. The design elements are inspired by the art deco architecture
        of the First United Building. Photo by JL JAVIER'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51253ffb-f53b-41be-b585-499f7bccf23a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'image'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ec03872d-3631-48c6-928a-06f65b772805'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The open-planned interiors has a seating capacity of 36 people but
        can accommodate up to 60 people. The space is designed for flexible use, with
        niches for people who want to have brainstorming sessions by the window for
        a relaxed environment, or hole in a more private setting. There is a long
        table for conferences, and shared desks at the lower half of the room for
        more collaborative users.</p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e206e0f9-2ddb-4fc6-8e29-d7ad7992d4c1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0fac9fc7-72f7-4eda-8c74-8a77665e3f55'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>First is in its activation phase and its creators hope to build
        the space around the needs of the community that will eventually spring from
        it.</p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c8b51bec-7e9b-4314-be0e-6f29249ab0cf'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8c991fc6-4b1d-4e71-936f-3a253dd8a7c7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.924+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>“We want to present a space where creatives won’t have to worry
        about actual office management and focus more on creating,” says Serrano.
        “As a creative myself, I draw inspiration from the space’s history and its
        possibilities.”</p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8339d05a-dc38-4245-921c-f368313f69c0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.924+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '77957989-59fc-47ae-8b2e-61374bf54b98'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:35:19.924+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The First United Building has an interesting mix of creatives:
        98B COLLABoratory pioneering artist initiatives in Escolta for half a decade
        now, architects, urban planners, visual artists, photographers, and social
        entrepreneurs,” he adds. “First aims to complement current efforts, like the
        Hub: Make Lab, by presenting an office environment that is inspired by this
        community building.”</p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8e823082-beb0-4bcd-b334-fe55411abf35'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:35:19.709+08:00
