  'secret-cell-demolished-senators-want-investigation':
    'author': 'CNN Philippines Staff'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T17:51:06.635+08:00
