    'lead': 'After the discovered secret jail cell in Tondo, Manila was demolished
      Friday, senators call for an investigation to strengthen the public''s trust
      with the police.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:40:38.281+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:40:38.813+08:00
