    'template': '1'
    'title': 'Secret cell demolished, senators want investigation'
    'updated': 2017-05-04T03:34:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5c925888-d2e7-4161-aa22-065f609b6249'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
