      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>(CNN Philippines, May 3) — The secret jail discovered inside a police
        station in Tondo, Manila by the Commission on Human Rights has been demolished.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6823c2a6-b1d6-4d19-9762-82da6a27847d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.815+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e488af5-6095-4c3a-a511-351e10e2cdcc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.815+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>PO3 Dexter Maniaul, desk officer of the Manila Police District Station
        1 at Raxabago, said the jail was demolished after the visit of National Capital
        Region Police Office chief Director Oscar Albayalde last Friday.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '410987dc-37b9-40d1-a702-e325a55a3b35'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
