    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '83e5f224-c13d-4217-90b8-3ace32b09392'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.817+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The CHR discovered the secret jail, which was hidden behind a bookshelf,
        during a surprise inspection of the police station on April 27.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '49d18d63-a8c4-4e24-867e-f745aaac0545'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.818+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6a35d6dd-5c68-4b20-8fcd-2e65fa747553'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
