      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The secret jail cell was discovered by a team from the Commission
        on Human Rights inside the Raxabago Police Station in Tondo, Manila.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '263e7d2d-6b89-4be6-ae67-2d339caaefd4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.282+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.819+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '61d27ca0-9250-4761-95dd-dde92749f0f8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.819+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Twelve persons were in the jail cell when it was discovered.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '66ab45bc-f5b1-46d2-8132-bc06836b9dd9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.820+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7f0e4f66-3ff6-40bb-a32e-ce6c4dad2022'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.820+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/04/28/Secret-jail-cell-detention-Manila-Police-District.html"><strong>Read
        more: CHR finds 12 people detained behind Tondo police station bookshelf</strong></a></p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '273f77ea-3ad9-4e40-86ff-fbcb1def8938'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.820+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9a14c230-6523-45da-a491-ce036dc3dbaa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.821+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Resolution to be filed for jail cell probe</h2>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bb828240-da66-4f51-98b9-5bec31d87ea3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.821+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senators called on the Philippine National Police to clean up its
        ranks to bring legitimacy to the Duterte administration''s drug war.</p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e1491013-e51e-4b2d-846d-ebbc1eb914ab'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.821+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd99a251b-e043-415c-8ef4-8b34077f1b08'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.822+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Sen. Bam Aquino filed Resolution 348 seeking to investigate the
        secret jail cell, saying the Philippine National Police should safeguard the
        public''s trust by ensuring that abusive policemen are investigated and punished
        accordingly.</p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6ed3ea94-fcf6-4be3-86e9-7e72024f4a46'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.283+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.822+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e5d093b-1c28-49bc-9371-2b704e769293'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.822+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Sen. Ping Lacson on the other hand, clarified his stand on PNP Chief
        Ronald Dela Rosa''s statement defending his policemen from the jail cell.</p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '09dbe320-7fa4-4de7-8bfd-bdaa86049bcd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.823+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd756b8ca-9062-410c-9f09-5a3e6c6af320'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.823+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Well I did not say that Chief dela Rosa was arrogant, that single
        act, how he responded, to the comments about ''<em>yung sa</em> secret cell,
        ''<em>yung</em> manner <em>ng pag-ano niya, ''yun ''yung nire</em>-refer <em>kong</em>
        arrogant [his manner of response is what I refered to as arrogant]."</p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e95b8f39-6785-4c59-a0e8-7c488b225470'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.823+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6d11af1f-23b5-474f-8eed-fc11e3696acc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.824+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Lacson took to Twitter to express his disappointment after the PNP
        Chief defended his policemen in a TV interview, saying they had done nothing
        wrong.</p>'
    '24':
      'contentWidth': '100%'
      'embedCode': '<blockquote class="twitter-tweet" data-lang="en"><p lang="en"
        dir="ltr">Defending an unlivable prison cell hidden behind a book shelf inside
        a police station is incomprehensible. It is also very arrogant.</p>&mdash;
        PING LACSON (@iampinglacson) <a href="https://twitter.com/iampinglacson/status/858621506812641280?ref_src=twsrc%5Etfw">April
        30, 2017</a></blockquote>

        <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>

        '
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '862e953c-23cf-4fb4-bc0d-200e96b39d32'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.824+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'embedCode'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f4496a70-7f21-498c-87ba-666d01576850'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.824+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>As dela Rosa''s former boss, Lacson said although he wants dela
        Rosa to succeed, he reiterates there''s no reason for dela rosa to defend
        the existence of the secret jail cell.</p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '319e47ca-ec9d-40b3-858f-9b44c71e7c42'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.824+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c44d9d08-60e3-42ac-86d3-c39f470a7ee9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.825+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"As simple as this <em>nakita mo merong</em> violation that''s plain
        view," Lacson said. "Even during <em>parang</em> implementation of search
        warrants—<em>maski hindi</em> covered <em>ng</em> search warrants <em>at nakita
        mong</em> in plain view na may violation, <em>pwede ka naman mag</em>-act
        <em>d''un</em>. It''s just good as saying <em>na nandoon na ''yung</em> violation
        right in front of you being committed <em>kasi malinaw sa batas hindi pwede
        ''yung</em> secret cell."</p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ffe6cf74-0ebf-400f-a754-dd1b5b51f30d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.825+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '43cc5163-ec88-47cd-bb83-d9fbd6ad361a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.284+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.825+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: As simple as this--a violation is in plain view. Even
        during the implementation of search warrants--even if it''s not covered by
        a warrant and the violation is in plain view, you can act on it. It''s just
        as good as saying that the violation is being committed in front of you, because
        the law clearly states secret cells are not allowed.]</p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '544853ce-3a6e-4d2e-b8e0-3250aaba26fb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.826+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'baa1cf29-c4cb-4d3d-939d-74d4d55c17ad'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.826+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Sen. Grace Poe agreed with Lacson, saying in CNN Philippines'' the
        source that the public should not lose confidence in the country''s law enforcement
        and judicial system.</p>'
    '32':
      'assetautoplay': false
      'assetcontrols': true
      'assetloop': false
      'assetmuted': false
      'assetpreload': 'auto'
      'embed': '<iframe src="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FCNNPhilippines%2Fvideos%2F1921452174761339%2F&show_text=0&width=560"
        width="560" height="315" style="border:none;overflow:hidden" scrolling="no"
        frameborder="0" allowTransparency="true" allowFullScreen="true"></iframe>'
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '765843eb-f38a-423d-8007-5196d0a8e151'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.826+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'video'
      'scale': 'true'
      'type': 'embed'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e2bad8f1-f67e-4289-95d6-df592f21db89'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.827+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Isn''t it quite disturbing also that if that''s your child, <em>nawala
        ''yung anak mo, pumunta ka sa selda, di mo nakita, walang</em> blotter, <em>walang</em>
        record.<em> E di parang desaparecidos, parang ganoon na rin ''yon kasi walang</em>
        record so <em>para sa akin kaya nga tayo, wag na nating pasamain ang sitwasyon</em>,"
        Poe said.</p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bdd59cc3-3a45-42d7-8d0f-29e5003b6862'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.827+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c112ec87-a098-4386-8a1c-e1acd0fd1cb9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:40:38.827+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Poe hoped that the PNP and the Justice Department will file cases
        so that international courts do not recognize and take over the investigations.</p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '18534f15-7b5e-4311-b044-bfc86b9cdae7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:40:38.285+08:00
      'mgnl:createdBy': 'eunice'
