  'grace-poe-probe-mrt':
    'author': 'Ver Marcelo, CNN Philippines'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T17:49:24.199+08:00
    'imagesource': 'jcr:0d0a2ab5-6181-45c4-8019-9439845877a2'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': '90754010-6776-4a78-a01f-9ab4355ff1bc'
    'lead': 'Senator Grace Poe filed a Senate resolution to look into the problematic
      maintenance of the MRT-3, as well as the acquisition of new train coaches.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:44:25.771+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:44:26.179+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Grace Poe calls for probe on MRT'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1036130b-c6b5-47aa-9529-9b05b56c3e3c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.771+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.179+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3)</strong> — A Senate
        resolution has been filed on Wednesday to investigate the inefficient management
        and maintenance of the Metro Rail Transit (MRT) 3, which has resulted in increasing
        train malfunctions.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6b63680c-d455-4220-ac28-e6e4028f9029'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.180+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'eee3f6f6-2dc2-4c57-a1c7-ddbaff12543e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.180+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Ang gobyerno ultimately is responsible for this, kasi sabihin na
        natin, pinuno ng nakaraang administrasyon ng abugado at hindi engineer ang
        DOTC (Department of Transportation and Communication) so puro sila wala namang
        alam sa technical," Sen. Grace Poe told CNN Philippines'' The Source.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '412a4852-732f-47ef-831a-c990f64b189c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.180+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a4ed9cac-cb0e-4d8d-8d6c-19700f3ad1ea'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.181+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>[Translation: The government is ultimately responsible for this,
        because, let''s face it, the previous administration filled the DOTC with
        lawyers, not engineers, so they had no knowledge in the technical aspects.]</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0f4f2369-75f5-4368-89f5-79831734dcee'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.181+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '843651cb-35f5-4907-970d-74437923e0c7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.181+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/04/27/busan-rails-old-trains-mrt-problem.html"><strong>Maintenance
        provider: Old trains cause of MRT problems</strong></a></p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd7473d1c-469f-4e2f-bff4-db27f786c801'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.182+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a38e9d3c-dd7f-4225-96d6-926686d460ce'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.182+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senate Resolution 355 will also look into the newly-acquired Dalian
        trains, which Poe said did not undergo the necessary tests before being delivered.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ab33810a-079b-46f2-8ff0-71ae47bd26da'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.182+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9550d517-9eaf-4843-b97a-40183f2462d2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.772+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.182+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The Senator added the new trains have incompatible parts, with the
        Dalian coaches acquired from China, the signaling system from South Korea,
        and the engines coming from Germany. The 48 new train coaches cost 3.8 billion
        pesos.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '90a392e0-8423-4ba3-bf58-4fc3278d2d76'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.183+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'aaba5b0f-3114-478a-ab5b-f6a50e051415'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.183+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/03/16/new-mrt-coaches-48-next-year-use.html"><strong>48
        new MRT-3 coaches cannot be used until next year - DOTr exec</strong></a></p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e0740a8f-5bbe-4a27-9efc-6d8a06cce31c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.183+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7a8c7d91-e3e9-4e78-b0ad-d611909421ac'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.184+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Saying that transport officials from the previous administration
        should be held liable, Poe said she would invite Transportation secretary
        Arthur Tugade, Undersecretary for Rails Cesar Chavez, former DOTC Secretary
        Jun Abaya, former MRT general managers Al Vitangcol and Roman Buenafe, and
        incorporator of MRT maintenance Marlo Dela Cruz to the hearing.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8970c61e-31d8-4cc8-bc28-7e601f7fee2d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.184+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '14fa0e7a-2759-4d78-9bfb-128990edfea0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.184+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"If they don''t show up with no good reason, I will have them subpoenaed
        because I think the people deserve to know what''s going on," Poe said, "We
        need to hear this as soon as possible because we only have about a month."</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '35e7ed52-70a3-474f-8afb-2815df5df0ae'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.184+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0cb41c70-92a4-4401-a000-61273b1dc771'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.185+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>National Safety Transportation Board</h2>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b1c151b3-16bd-42a6-972e-8552e4642130'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.185+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In light of the recent road accidents primarily caused by vehicular
        malfunctions, Poe is also pushing for the establishment of the National Transportation
        Safety Board (NTSB), solely dedicated to ensuring passenger welfare.</p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '66d233dc-8739-42a3-a001-21fd8d744d81'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.185+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3adb8b84-8e7d-49e6-a03f-217031c0bfe2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.186+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Poe said the NTSB would be responsible for investigating "air, land,
        and sea tragedies."</p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ed15bc1c-f1d7-44a2-a7f5-a3d78063ab12'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.773+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.186+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9b936bb3-c027-45c8-9dfa-2d2f185c0f89'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.186+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"You have the LTO (Land Transportation Office) and the LTFRB (Land
        Transportation Franchising and Regulatory Board) being the ones investigating
        when they themselves are the ones that issued the permits for them to operate.
        Naturally they would be biased because they might step on people''s toes within
        their department," Poe said.</p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4f9d59ad-2331-42e5-baf9-feaac34dd042'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.186+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0c73ddbf-cdc0-4439-9fac-0997e01cc42d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.187+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/04/24/ltfrb-to-intensify-drive-against-older-buses.html"><strong>LTFRB
        to intensify drive against older buses</strong></a></p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd10b2108-7bc9-4105-9ca6-c7956c717def'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.187+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'eef890df-9f31-41fb-a661-d2f087b6e456'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.187+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Ang nangyayari (What happens is), they are already spread thin
        doing their other functions, they can''t be the investigating body," she added.</p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '22d0dfb8-e989-4d8a-b598-14a552250bcd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.188+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '382e03fc-ee61-4adc-8de7-1220b1dd2c62'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.188+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>With traffic congestion being an increasing concern in major roads,
        Poe said she lobbied in the Senate for the emergency powers be fully granted
        to President Rodrigo Duterte to help alleviate the problem.</p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c7746d82-7648-4d43-9aa0-f4c690ba9468'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.188+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1f800cac-cc43-4f4d-91cd-1fb34f160618'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.188+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"You know what, a lot of the delays are basic things like right
        of way, even if you have imminent domain, sometimes you need government muscle
        to get the courts sometimes out of the way, so that there won''t be any TROs
        (Temporary Restraining Orders)," Poe said.</p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a8ee3282-ea65-453a-a21b-53b1369ee293'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.189+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c01be110-219a-47f7-ae3a-16e7b2493f59'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.189+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>However, she is pessimistic that their counterparts in the House
        of Representatives would approve the measure.</p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '937931b3-1bad-47c4-969c-ba1ee3c7419e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.774+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.189+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3ea38227-af19-4838-bcc2-9868ce9b2235'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.775+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.190+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"You know what, even if we pass it in the Senate, congress doesn''t
        want to pass it....with barely a month left, I doubt. And then, with Congress
        not even, I think, in the period of interpellation," she said.</p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9e3268f3-c278-488a-8c1f-07933783b4f4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.775+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.190+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7c4c7868-ce10-47e6-a305-34041e3fe5ea'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:44:25.775+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:44:26.190+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><em>CNN Philippines'' Regine Cabato contributed to this report.</em></p>'
  'Tito-Sotto-Judy-Taguiwalo-DSWD-single-parents':
    'author': 'Lara Tan, CNN Philippines'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T17:45:43.416+08:00
    'imagesource': 'jcr:30eef9aa-5174-45fe-ae07-859c91617ad1'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'e364302a-0975-4efa-b591-a8b6caa10b90'
    'lead': 'Senator Tito Sotto said, "I don''t think there should be a big fuss about
      it... I will be the last person in this country to disrespect a woman... I have
      two daughters who are separated, who are single and have children."'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:51:32.178+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:51:32.479+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Taguiwalo defends solo parents vs. Sotto tirade'
    'updated': 2017-05-04T11:03:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8e973e77-25f4-4b58-92de-fa872ccb536c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.178+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.480+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines) —</strong> Senator Tito Sotto
        III is in hot water for his "malicious" comments on solo parents.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '21727558-94f3-42da-b600-1d11a18942b8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.178+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.480+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ac56df6a-cd81-482d-9c72-d990cec5f88b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.178+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.480+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>During the Commission on Appointments hearing of Social Welfare
        Secretary Judy Taguiwalo, Sotto attempted to shift the focus on a "lighter"
        topic.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '880ebb8f-d408-46c0-9197-0efebb5139b0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.178+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.480+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9f4b41ba-24e7-42d2-83f0-2cdefce260c2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.178+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.481+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"You have two children? Two daughters <em>ba o sons</em>?," to which
        she replied she has daughters.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '020aff32-8b08-4ae5-875f-c7773e438b88'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.481+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd6368f4a-f7dd-489f-8b34-113406b5edc1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.481+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He, then, followed up with, "but you''re single?"</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bb0a6ee2-660b-4799-9d61-7440838a6ab0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.482+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '96f4913e-6304-49ee-8f25-79e8d40eadca'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.482+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Taguiwalo, a single mother of two children, explained that she doesn''t
        consider her personal life as a typical family set-up.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b78b5303-fb14-4279-8e20-e4b4b0060753'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.482+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '014faf24-d000-44e1-b363-01617f986bf3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.483+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I never had a father-mother-children kind of thing except when
        I was growing up in Bacolod... My story would be different from stories of
        those who have gone through...," she said.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '24c51e60-4024-47dd-ae28-c599716d43f6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.483+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '65f13e43-497b-4613-81cd-3ebdf1b7f012'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.483+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Deviating from her story, Sotto tried to explain what to call a
        person who raises children on their own.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '98fe9391-8298-4543-aa08-42bcc9fd9fb3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.179+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.484+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5a28136a-be04-4fb6-8bf7-f1e5c115695e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.484+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"In the street language, when you have children and you are single,
        <em>ang tawag dun e, ''na-ano lang</em>,''" he said.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '248ed447-d3fc-4206-b4ca-2c1d1b4bb48a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.484+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9cdf4e6e-844b-46f3-af10-f592c3ac4010'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.484+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Taguiwalo, a champion for gender equality and women empowerment,
        replied that as a professor, she respects all kinds of families.</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '95f4e0f6-8dd6-487e-b981-8f6703e8e492'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '608804c4-a700-4985-9ad9-e373fc2b8560'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Amidst the laughter in the room, Taguiwalo calmly said, "Senator
        Sotto, I teach women studies. So, we respect all kinds of families and that
        includes solo parents."</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0be51abd-600d-4e42-950d-5693b317e89e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f0a4bebf-d681-4827-821e-b037ae68690a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Despite this, Sotto he gives his 100 percent support to the secretary.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '693b50af-65bb-4d19-bec8-93f472baaef1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '95cac303-6f2b-47de-8991-95881bb11946'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:51:32.180+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:51:32.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Sotto: Sorry if they feel offended</h2>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '883436e1-530d-4266-8362-ddc5897f278c'
