    '30':
      'contentWidth': '100%'
      'embedCode': "Metro Manila (CNN Philippines) — Senator Tito Sotto III is in\
        \ hot water for his \"malicious\" comments on solo parents.\n\nDuring the\
        \ Commission on Appointments hearing of Social Welfare Secretary Judy Taguiwalo,\
        \ Sotto attempted to shift the focus on a \"lighter\" topic.\n\n\"You have\
        \ two children? Two daughters ba o sons?,\" to which she replied she has daughters.\n\
        \nHe, then, followed up with, \"but you're single?\"\n\nTaguiwalo, a single\
        \ mother of two children, explained that she doesn't consider her personal\
        \ life as a typical family set-up.\n\n\"I never had a father-mother-children\
        \ kind of thing except when I was growing up in Bacolod... My story would\
        \ be different from stories of those who have gone through...,\" she said.\n\
        \nDeviating from her story, Sotto tried to explain what to call a person who\
        \ raises children on their own.\n\n\"In the street language, when you have\
        \ children and you are single, ang tawag dun e, 'na-ano lang,'\" he said.\
        \ \n\nTaguiwalo, a champion for gender equality and women empowerment, replied\
        \ that as a professor, she respects all kinds of families.\n\nAmidst the laughter\
        \ in the room, Taguiwalo calmly said, \"Senator Sotto, I teach women studies.\
        \ So, we respect all kinds of families and that includes solo parents.\"\n\
        \nDespite this, Sotto he gives his 100 percent support to the secretary.\n\
        \nSotto: Sorry if they feel offended\nIn an interview after the hearing, Sotto\
        \ said he believes Taguiwalo was not offended by his remarks.\n\n\"She was\
        \ ready to answer anything under the sun. I don't think there should be a\
        \ big fuss about it,\" he said.\n\nHe also defended himself, saying he does\
        \ not disrespect women.\n\n\"I will be the last person in this country to\
        \ disrespect a woman because my mother was one of the founders of the Women's\
        \ Rights Movement. I have two daughters who are separated, single, and have\
        \ children,\" he said."
