      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>No CA member objected to the motion, although some lawmakers made
        their manifestations, including Senators Tito Sotto, Kiko Pangilinan, JV Ejercito,
        and Loren Legarda.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'dbcb6be2-92c1-46ef-9521-1eecfb29572f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.513+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.911+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8950176a-87fb-4e80-9106-a90fc9c76141'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.513+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.912+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The senators, who said they voted for Lopez''s confirmation, said
        they are saddened but they respect the decision of the majority.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a096e1ab-4e91-4b87-a2dd-214bcda535c8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.912+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '08b6495d-54eb-4d7c-aa2c-6b15c44e3ea3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.912+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"To Gina I truly admire your passion and love for the environment,"
        Pacquiao said as he announced his committee''s decision to disapprove Lopez''s
        appointment.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e97eb7d-548c-476c-a58f-78814e86fa25'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.912+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'caaa56a8-fb60-446c-acde-a403bddf5497'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.913+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senate Minority Floor Leader Franklin Drilon said the Liberal Party
        actually voted as a bloc for Lopez''s confirmation. "Unfortunately, we lost
        in the vote," he said.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5d6399d8-01d8-4292-944d-cdf270a325df'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.913+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e177648d-83e0-400a-9539-1ce107fd4899'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
