      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Legarda, an environment advocate, said: "It is unfortunate that
        we let pass an opportunity for the Department of Environment and Natural Resources
        to be led by someone who has the passion, integrity and political will to
        implement our environmental laws."</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7ea472e2-2f9e-4bf6-9380-508594a2e5fa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.913+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '070712b8-6698-4524-b662-199228dab88a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
