      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Serve the people</h2>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '21555973-c5a1-4267-95f4-94e7a115b931'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.914+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>An emotional Lopez faced the media after the announcement of her
        rejection.</p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c7260ff9-2c38-4d47-956f-eb48243ee856'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.514+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.914+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1afac6e7-ec48-4728-aa57-4a7323e883ac'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.914+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"It is unfortunate that business interest have in fact run the day
        - because that''s really what it is," Lopez said.</p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '886005fa-a581-4cfe-940c-e320e793848a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.915+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '898c8ef6-98c0-4df0-b331-cf93c7b3dc06'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.915+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>She applauded the eight legislators who "voted according to their
        conscience." She said 16 others voted against her appointment.</p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a8539cd8-689f-474d-9124-f78f474be92e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.915+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '64c534d9-5fb2-4db8-9d08-8f26b3208fdd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.916+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>She urged the lawmakers to look after the needs of the poor and
        not of big businesses.</p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6ffd1566-1208-4414-a8d6-756fe099cfda'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.916+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7402dfbc-c055-490f-acd2-d02710408582'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.916+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"If government co-opts to big businesses, then what hope does the
        poor have? What message are we giving here? If you wanna be confirmed, don''t
        go against big businesses," Lopez said.</p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8abc684d-06d8-4eec-8a53-94a3487dfd0c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.916+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b4464049-28e6-40a3-8b56-1398cc966a93'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.917+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Lopez is the second presidential appointee to be rejected by the
        CA – next to former Foreign Affairs Secretary Perfecto Yasay.</p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '41c1251f-2e8a-4625-8c0d-4fe132c92bb3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.515+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.917+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9a1c5c8b-d3b4-45aa-afb8-5cb55c1e2fea'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.917+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/03/08/DFA-Secretary-Perfecto-Yasay-appointment-denied.html"><strong>CA
        rejects Yasay''s appointment as DFA Chief</strong></a></p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ea6260b7-b44a-4d29-86e2-00b234797bcf'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.917+08:00
