      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1566d56f-fc51-43b3-84ad-9e97b59da428'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.918+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Lopez had faced three confirmation hearings where she answered critics
        opposing her appointment. She was also bypassed by the congressional body
        in March but <a href="https://cnnphilippines.com/news/2017/04/18/Duterte-reappoints-bypassed-Cabinet-secretaries.html">President
        Rodrigo Duterte reappointed her</a>.</p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd5deddbc-59ca-48f3-944c-7121a266959b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.918+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a9629a78-ce4e-4d21-8f54-77b16ff26074'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
