      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Malacañang: We respect CA decision</h2>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2cfd266c-3487-4377-be75-0e9788678801'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.918+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Duterte has always expressed support for Lopez, but Presidential
        Spokesman Ernesto Abella on Wednesday said Malacañang respects the decision
        of the CA.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
