      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"It is of course with deep concern that CA has seen fit to reject
        her appointment. On the other hand it''s a democratic process and we respect
        their decision," Abella said in a chance interview with reporters.</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '947d0555-1a4c-4f38-93cf-13d0e0cb1e1f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.919+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '49cdbfc7-c7d7-4c47-b200-138e8008ac6e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.919+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Lopez''s order in February to close 23 mines and suspend the operations
        of five others did not sit well with miners and some government officials
        who accused the Department of Environment and Natural Resources (DENR) of
        not following due process in its audit.</p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '61d6fc1d-e4f0-4d7e-b0a0-c43a271cb0fe'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.516+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5b469a0c-1d2b-482f-bcfe-446bb213e56c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Duterte himself has consistently backed Lopez and the communities
        harmed by erring miners. However, he has also stressed the need for due process
        and rule of law in any mining review.</p>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '36a3c3cd-fe1b-41e0-9d77-0265d2d369ec'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bbad8b21-62eb-46a6-905c-451d880e0bd6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.920+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/03/11/president-duterte-denr-secretary-gina-lopez-mining.html"><strong>Also
        read: Duterte: I’d rather follow Gina Lopez than get ₱70B in mining revenue</strong></a></p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cca7fd6c-7119-4f22-8b1c-01d3c174a814'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8aaf2f2b-3b9c-450b-b1fa-4e716f567e3f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Lopez said she could not think of anyone who can lead the Department
        of Environment and Natural Resources (DENR) other than Duterte.</p>'
    '43':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c64b0822-4b33-4a7e-abd5-9937b2765cb2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '44':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0971f26e-dc57-44e7-a2d8-69225a2f43fe'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"He''s the only one that has the guts...It needs guts, it needs
        tapang (courage) because you have to step on business interest," Lopez said.</p>'
    '45':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e8d7922a-7f25-424b-8ebc-18e42dcc6f6b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.921+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '46':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bef5543d-8c67-45d7-a118-dd8b43f075f1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I would still offer my service to President Duterte in terms of
        development because that''s my skill," she added.</p>'
    '47':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a3163bce-1c01-483b-9919-9b5c772cf376'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '48':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ec96ba1d-7c48-46f4-8ef6-d5ec2aab1836'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.517+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>''New beginning for mining industry''</h2>'
    '49':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9887253e-afd1-442d-b352-96f3d7fcfc32'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.518+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.922+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Meanwhile, the Chamber of Mines of the Philippines, which vehemently
        opposed Lopez''s appointment, thanked the CA for rejecting Lopez.</p>'
    '50':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd72b05f6-1f25-4614-99da-62e6748c6ef1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.518+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '51':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2f90673c-62b1-442c-92b5-a3be9e008a29'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.518+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In a statement, it said this marks the "beginning of a new chapter
        for the mining industry."</p>'
    '52':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '55bc9e1f-92af-40ef-a1ff-e51803a9370d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.518+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '53':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '339c44dd-668d-4919-a59f-7cfce93c16a4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:55:58.518+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:55:58.923+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"We reiterate our commitment to work with the DENR and the next
        Secretary to protect the environment and promote the responsible use of our
        natural resources," the group of miners said.</p>'
    '56':
