  'Duterte-Cayetano-drug-war-United-Nations-Geneva':
    'author': 'CNN Philippines Staff'
    'caption': 'File photo: President Rodrigo Duterte (left), and Sen. Alan Peter
      Cayetano (right)'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T14:21:57.756+08:00
    'imagesource': 'jcr:1f6a42d7-88c6-47f5-8a25-3a4aa6121424'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'a6587e49-1e24-4a63-af1d-0333a6544d6a'
    'lead': 'Senator Alan Peter Cayetano will join the PH delegation that will defend
      the government''s drugs war in Geneva, Switzerland'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T10:59:37.909+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T10:59:38.997+08:00
