    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Duterte admin to defend drug war before UN in Geneva'
    'updated': 2017-05-06T14:43:00.000+08:00
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '72554b8c-d922-49bf-ac26-8a08c0210adf'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:38.998+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3)</strong> — A Philippine
        delegation from the Duterte administration will defend the government''s war
        on drugs before the United Nations in Geneva, Switzerland.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a8dc97b4-d7da-4dd6-b5f8-bdd4b8a71f77'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:38.999+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4c5c0628-e0f0-4c4a-b052-37de1d240c99'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:38.999+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The United Nations Human Rights Council''s Universal Periodic Review
        (UPR) will examine the country''s human rights record on May 8.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1b7f2f2c-2127-4715-ad62-7b0d03f0ff2e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.000+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd92ff9b3-b80b-49ed-ab19-3b16a80585b1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.001+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senator Alan Peter Cayetano said on Tuesday he will join the delegation
        headed by Senior Deputy Executive Secretary Menardo Guevarra to defend the
        Philippines'' drug war.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4785b9f0-a28c-48ea-bb97-1391ec19be62'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.001+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2f8c1151-16c7-4162-af1c-41311d784312'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.002+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The President will be sending a composite team headed by Executive
        Secretary Guevarra and myself to face the UN for our periodic human rights
        review," he said.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '48880418-e3f4-435e-a88b-1a9ca75debf2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.910+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.002+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'af6f60b1-b26d-45e1-873e-131afbebabbb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.911+08:00
      'mgnl:createdBy': 'eunice'
