      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The delegation seeks to debunk reports by some local and international
        media and human rights groups that an estimated 7,000 people were killed in
        the government''s crackdown on drugs.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f80c9ea8-1241-4407-8874-c2cc78596a27'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.911+08:00
