      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Simple <em>lang</em> strategy <em>namin: Mali yung mga sinasabi</em>
        regarding campaign on drugs," he said.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bcd61559-5e93-4268-baa2-ec6bdf56d80b'
      'mgnl:activationStatus': true
