      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4efe9bb9-c40e-4ac3-9b24-8dbda4a9c1c5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.911+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.006+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>A government-initiated forum claim on Tuesday that 7,000 were killed
        in the drug war is "clearly misleading."</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '78006bdf-fbde-4448-8096-670c3f559a83'
      'mgnl:activationStatus': true
