      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'eddd9d23-0100-4f58-9f64-c9ccb674f37f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.911+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.008+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/05/03/statistics-Duterte-war-on-drugs.html"><strong>Related:
        Gov''t forum clarifies numbers in Duterte''s war on drugs</strong></a></p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '34fec9b5-4ab7-4471-b9da-5733a0a09200'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.911+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.008+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a5972f59-3d04-471d-848b-30c3bf53b9fa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.009+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>At the forum #RealNumbersPH, an infographic based on data from the
        Philippine Drug Enforcement Agency (PDEA) clarified that only 2,692 individuals
        died during anti-drug operations from July 1, 2016 to April 20, 2017,</p>'
    '19':
      'contentWidth': '100%'
      'embedCode': '<blockquote class="twitter-tweet" data-lang="en"><p lang="en"
        dir="ltr">Claiming 7,000 killed in the <a href="https://twitter.com/hashtag/drugwar?src=hash&amp;ref_src=twsrc%5Etfw">#drugwar</a>
        is clearly misleading. <a href="https://twitter.com/pnppio?ref_src=twsrc%5Etfw">@pnppio</a>
        reports show 2,692 died in anti-drug operations. <a href="https://twitter.com/hashtag/RealNumbersPH?src=hash&amp;ref_src=twsrc%5Etfw">#RealNumbersPH</a>
        <a href="https://t.co/3N7bPgcCNh">pic.twitter.com/3N7bPgcCNh</a></p>&mdash;
        Department of Social Welfare and Development (@dswdserves) <a href="https://twitter.com/dswdserves/status/859299343974580224?ref_src=twsrc%5Etfw">May
        2, 2017</a></blockquote>

        <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>

        '
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd1ee1d7c-d13c-493c-8414-dd3d0ba492ab'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.009+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'embedCode'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a15bfccd-7b82-4128-ab8a-15784b4f6932'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.010+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Presidential Spokesperson Ernesto Abella on Friday said the Philippine
        delegation will also bring up their concerns with UN Special Rapporteur Agnes
        Callamard.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7eecb7d0-0d50-4ba4-ac81-723b6a52c920'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.010+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '93a0700b-d358-41e0-b2f7-c1210e95051d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.011+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"If Dr. Callamard is committed to ensuring due process to our government
        and a truly objective assessment of our record on an issue of tremendous importance
        to our nation, she should be in Geneva meeting with our representatives,"
        Abella said.</p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9c47b784-1ac0-414f-9236-ece1a75d792e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.011+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '86b9ee75-5089-4a69-8314-86bad70d4525'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.012+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/05/05/Malacanang-slams-Callamard-visit.html"><strong>Related:
        Malacañang slams visit of UN rapporteur to PH</strong></a></p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6c7dd76f-ebcb-405c-a468-7bf254bed22d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.012+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e970f0da-ab50-4235-aae6-6c6b5cdee8a7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.013+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In a keynote speech in the country on Friday, Callamard condemned
        the war on drugs anew and urged international commitments on combating illegal
        drugs.</p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'aa947e90-a3b9-477d-883e-18696ec17279'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.014+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4d639520-9f7d-4c73-be44-765075320025'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.912+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.014+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The General Assembly of the World''s Governments recognized exclusively
        that the war on drugs - be it community-based, national or global - does not
        work," Callamard said at the "Drug Issues, Different Perspectives," forum
        held at the at the University of the Philippines (UP) from May 5 to 6.</p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f28a508e-e6c9-48ba-bd8b-b9466b5b67ab'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.015+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6b9a9b29-80d7-4d7e-a722-8121ccfc184d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.015+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Aside from the drug war, the two-day drug policy forum will discuss
        cases of alleged extrajudicial killings, corruption, restoration of death
        penalty, and attacks on media.</p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6ff8630f-fa27-436f-845a-faa29b95a198'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.016+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '56cc4c4e-94dc-417e-8c28-8f40d04e5a02'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.016+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The UPR Working Group is scheduled to adopt the recommendations
        made to the Philippines on May 11.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd338f043-f479-4863-b283-bb7c3bd47a6e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.016+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '69ad7642-f9bb-472c-a4b8-d4c4c9770485'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.017+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The meeting this May will be the third time the country will face
        the UPR reviews, in 2008 and 2012, respectively. The review is held every
        three years. During the third UPR cycle, the countries are expected to once
        again detail the steps they have taken to implement the previous recommendations.</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '03ff8f1b-b565-4251-a949-8658b073f76a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.017+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '27b57018-f333-4c95-98a4-acb70d784bc6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.017+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Fourteen other countries will be up for review in the upcoming session.</p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7372000e-f89c-438d-9618-8d15980db220'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.017+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '612e6ab3-9e10-4195-8ebb-efdce484ce9f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.913+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.018+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>CHR to attend review</h2>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b79d5cb3-1807-4469-912e-8235a57ab14a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.018+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The Commission on Human Rights, who has been critical of the administration''s
        war on drugs, will also go to Geneva as observers.</p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4ef25714-3bc3-4701-9eef-9e815d1694b9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.018+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd95c8965-8a13-4a61-9ba2-be5a115330ae'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.019+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The CHR is going but we are not a part of the government delegation
        because while the CHR is a state institution, it is not part of the government,"
        Commissioner Chito Gascon said. "We will monitor the report of the government
        led by (Cayetano) and (Guevarra). What they say and what they commit at the
        Human Rights Council in Geneva will be matters we will follow through once
        they come back."</p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1ce3e4fb-ee37-4966-a1eb-6e62255f330c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.019+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '43':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3720a13b-5d53-4353-b9c3-b3e28e2643f0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.019+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Gascon said the Commission''s report should be independent from
        the government, as a watchdog of human rights violations.</p>'
    '44':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6c42ff55-acce-4d64-8e01-f3779c4725b7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.020+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '45':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '06fcb27f-1d1c-4d01-bac5-9d58148df37d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.020+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He said the review will be from 2012 up to the present, which may
        dwell on the high number of killings due to the war on drugs.</p>'
    '46':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c8e03c2c-1976-498e-9e75-35ae98ab7df4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T10:59:39.020+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '47':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e0843976-f3b6-4a39-b004-8a212058715f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T10:59:37.914+08:00
      'mgnl:createdBy': 'eunice'
