      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The government has the opportunity to refute those numbers among
        their peers there. Ultimately it will be a matter for the Human Rights Council
        to decide among themselves what recommendations they will give after they
        receive the report from the state," he said.</p>'
