      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines)</strong> — De La Salle University
        Lady Spiker Majoy Baron was named Most Valuable Player (MVP) of the women''s
        volleyball tournament in the University Athletic Association of the Philippines
        (UAAP).</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '607edceb-fc23-46ec-a2f4-1bb0fcce99fa'
