      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Baron beat out the likes of National University star Jaja Santiago
        and teammate Kim Fajardo to the MVP plum.</p>'
