      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN) —</strong> Prince William and his wife Catherine are
        seeking $1.6 million (1.5 million Euros) in a trial for damages from a French
        magazine that published topless photos of the Duchess of Cambridge in 2012,
        the magazine''s lawyer told the UK Press Association on Tuesday.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bbda68d6-0557-4862-8a8b-452cc12626bf'
      'mgnl:activationStatus': true
