      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3a87df1d-54df-4cf2-9fbd-593b5392d8df'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.299+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The trial began Tuesday in France for six people associated with
        Closer magazine and regional newspaper La Provence, the Press Association
        reported. The French magazine Closer is separate from the UK''s Closer magazine.</p>'
    '3':
