      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5baa11b4-b688-466f-87da-a6d20f808393'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.299+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.485+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The images showed the duchess sunbathing topless while on holiday
        in the South of France in 2012 in the couple''s private villa. They scandalized
        St. James Palace and dredged up memories of the royal family''s rocky relationship
        with the media 15 years after the death of William''s mother, Princess Diana,
        as she fled photographers in Paris.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8804d9e4-4638-479d-87bd-6b76be42ec6a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.299+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f4acb7d8-8257-44b1-ad8c-e1fe5a50520e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"The incident is reminiscent of the worst excesses of the press
        and paparazzi during the life of Diana, Princess of Wales, and all the more
        upsetting to The Duke and Duchess for being so," a palace spokesman said in
        2012.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8f46e4e2-da73-43b2-963e-1a8c2eff0e18'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '20ce3f13-1dd5-4d74-bffb-e3e0722e62b3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.486+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>According to the Press Association, Ernesto Mauri, chief executive
        of the publishing group that produces Closer, faces one charge of using a
        document obtained by a breach of privacy, along with Marc Auburtin, La Provence''s
        publishing director at the time. Laurence Pieau, editor of Closer magazine,
        is charged with complicity. Agency photographers Cyril Moreau and Dominique
        Jacovides and Valerie Suau, who was a photographer for La Provence, face charges
        of invasion of privacy and complicity.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '053f759f-aff2-4685-a1f8-2193c3dd858a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.487+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '33707b8a-445a-4c0c-9847-9b624c2891fd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.487+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Jacovides and Suau deny taking photographs that were allegedly sold
        to Closer, the Press Association reported. Suau, who is accused of taking
        photographs that ran in La Provence, told the court she did not intend to
        breach the royals'' privacy.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '24ff1fcb-330b-456a-8101-78ab53c14fde'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.487+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3bbdc4ed-9d8b-4ffa-94f9-fb5c25bce7b1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.487+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Paul-Albert Iweins, representing Closer magazine, argued that the
        photos cast the royal couple "in a positive light" and did not constitute
        a breach of privacy, the Press Association said.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9a2e3b87-7d10-42f8-a497-fa0dcd7c8ad9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.488+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '75f9b5a7-55b3-4aa2-9ed0-cd052cf82408'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.488+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Prince William said the decision to publish topless photographs
        of his wife was "particularly shocking" given his late mother''s battles with
        the paparazzi.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '56ec5f00-d5ea-4970-bfc5-5a3b0c737f32'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.300+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.488+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '613244dd-e0f3-4377-8271-5c6635194d7b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.489+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The couple''s lawyer, Jean Veil, read a declaration in court Tuesday
        on William''s behalf.</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '88a32870-9c58-43c3-b178-8eb5a6dda6ca'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.489+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c7fd0a7d-1b23-422c-af56-1e5288c4dd1f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.489+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"In September 2012, my wife and I thought that we could go to France
        for a few days in a secluded villa owned by a member of my family, and thus
        enjoy our privacy... The clandestine way in which these photographs were taken
        was particularly shocking to us as it breached our privacy."</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3bd07976-12c2-441c-a00c-c900fb87f92b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
      'mgnl:createdBy': 'eunice'
