      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6fc1d1b5-b280-4d15-8026-e1e66133426c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:14:21.489+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>A French court fined Closer in 2012 for printing the images and
        banned it from the distributing the magazine in print or online.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '65c79438-5eea-4121-befb-ad1065663e81'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:14:21.301+08:00
