      'text': '<p>Second, a hearse? Points for originality and utility.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ce2895d8-599f-4643-a645-12d931b328da'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.568+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '87e07bb7-35dc-4208-aeee-5c3f38abf18f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.568+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He had to assume that no one would ask questions if he was carrying
        a dead body to its final resting place. Only there was no dead body in this
        casket - just bricks of marijuana alongside bricks of manure he assumed would
        hide the odor.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '92063a9a-fa75-400f-9073-5493c0e59cdb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.569+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '769ab4ae-aa59-41f0-8afb-d5b4287c3306'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.569+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>His efforts, while intriguing, weren''t enough to keep the suspicious
        eyes of the border agents, who seized the marijuana and hearse during a immigration
        vehicle stop near Tombstone, Arizona, over the weekend.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e23dc977-1b44-4189-81c2-86b0db24849a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.569+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '80c562bf-557a-4e0a-9a8b-6144d0954118'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.569+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Also - somewhat unrelated - unless your parents own a funeral home,
        how does one get their hands on a hearse? Is there a Craigslist tab for that?</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '95aa742e-aae3-4aeb-8232-b50a28809bb1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.570+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6cc42dc7-1324-40cd-9b5a-e615db1c5402'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.570+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The 28-year old male driver is behind bars facing charges of narcotics
        smuggling.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9fd2a53f-5344-4eea-b5a0-1e81b2cef042'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.343+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.570+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9f6fdb8c-b5fe-407a-8045-f78611fa1d48'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:17:18.344+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:17:18.571+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><em>This story was first published on CNN.com "<a href="https://edition.cnn.com/2017/05/02/us/trnd---marijuana-hearse/index.html">Man
        tries to smuggle 67 pounds of pot into the US in a coffin. But points for
        originality</a>."</em></p>'
  'Ed-Sheeran-Game-of-Thrones-character':
    'author': 'Lisa Respers France, CNN'
    'categories': ['111cf2e1-ee3e-406d-8e6d-d80924595c9c']
    'created': 2017-05-03T09:19:17.084+08:00
    'imagesource': 'jcr:e435403e-cdad-49fa-8046-857c5be06ec5'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': '9bdf582a-0d40-4052-8b14-ef9b260931e4'
    'lead': 'He revealed he has a scene with "Game of Thrones" star Maisie Williams.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:19:43.439+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T11:19:44.624+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Ed Sheeran talks ''Game of Thrones'' character'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7777788e-ae55-45cf-91ea-18bb35d7b77e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.439+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.624+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN) —</strong> Get Ed Sheeran to play some beer pong and
        he might just spill about his "Game of Thrones" role -- at least that''s what
        happened during a recent radio interview.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a79b689f-4a39-4d52-8c39-988df4e88daf'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.439+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.625+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c32e5217-9789-4196-9113-5a883191e727'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.439+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.625+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The singer, who has a small role in the upcoming season of the HBO
        epic, told a U.K. radio host he was star struck "taking a pee next to Kit
        Harrington" before the pair became friends on the "Game of Thrones" set.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '84009cec-9d65-4f0f-ab8d-71b1cccae6fa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.439+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.625+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '872aec09-345e-4d12-8b6c-3ba84818d899'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.439+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.626+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Sheeran said he filmed his part in November and "it was really fun."</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '91777055-caab-4dd3-ba5a-4874fb569518'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.626+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c50e3cf4-5f26-447a-8f24-b7d476ecad36'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.627+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He revealed he has a scene with "Game of Thrones" star Maisie Williams.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '85447d9e-0219-41e2-bb44-6419f5720c30'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.627+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '849c44c4-1227-4d38-9451-4a8e2c677bcc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.627+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I sing a song and then she goes, ''Oh, that''s a nice song,'' and
        I go, ''It''s a new one,''" Sheeran said.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '45694be8-1f2c-4ec9-8b9c-34f5d2c37d6f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.627+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '39264005-969d-43d5-86e7-2c018e86da12'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.628+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>That''s not much to chew for loyal "Thrones" viewers, but Sheeran
        added he wasn''t sure what he was allowed to share about Season 7.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '34fe1e91-17e6-4f9d-9c4b-283e9709e357'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.628+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6fba1a19-6b9b-443c-86d9-9164157b8da3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.628+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Game of Thrones" showrunner David Benioff announced in March the
        series had created a part for the "Shape of You" singer.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9b21e4c9-1fde-4c6f-85dd-d477e113b85e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.629+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '129762ae-63c1-4653-8602-1e219916fd76'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.440+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.629+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"For years, we tried to get Ed Sheeran on the show to surprise Maisie
        (a self-proclaimed Sheeran fan), and this year we finally did it," Benioff
        said.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6fc8450c-1dc5-4b0b-8e4c-99497d19281b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.629+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a6a192e8-aa47-43eb-a0cd-34f0c2ff08e3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.629+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>As for more acting, Sheeran said he''s working on an upcoming film
        in which he''s also participating in the soundtrack.</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5ad4a736-9c7e-4405-b7ed-0a0bd19e87a4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.630+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cac868f6-f8b1-4e6f-81ba-e6536d663c8c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.630+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I wanted to basically do ''8 Mile'' meets ''Notting Hill,''" he
        said. "Like English rom-com, but with music."</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cf9e4453-93fc-49fc-bef3-68f338e0e3be'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.630+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3ec19abf-a8de-46c4-a12a-009680719500'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:19:43.441+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:19:44.631+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><em>This story was first published on CNN.com "<a href="https://edition.cnn.com/2017/05/02/entertainment/ed-sheeran-game-thrones/index.html">Ed
        Sheeran talks ''Game of Thrones'' character</a>."</em></p>'
