      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Meanwhile, Presidential Spokesperson Ernesto Abella congratulated
        the Bar passers in a statement and encouraged them to join the government.</p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e343207d-2bea-40ed-be1b-c138b4b7b6e2'
