      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"We pray that many of the successful examinees would pursue a career
        in government and join us in building a progressive and inclusive nation with
        a trustworthy government run by young people full of idealism, integrity and
        excellence," he said.</p>'
    '36':
