      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The exam covered Political Law, Labor Law, Civil Law, Taxation Law,
        Criminal Law, Commercial Law, Remedial Law, and Legal Ethics.</p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3af8eaae-42fd-4052-8db3-d7da96a9bd37'
