      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The oath-taking of the Bar passers will be on May 22 at 3 p.m. at
        the SM Mall of Asia Arena.</p>'
