  'Jimmy-Kimmel-baby-heart-problem-Obamacare':
    'author': 'Lisa Respers France, CNN'
    'categories': ['111cf2e1-ee3e-406d-8e6d-d80924595c9c']
    'created': 2017-05-03T10:07:54.397+08:00
    'embedsource': '<iframe width="750" height="452" src="https://www.youtube.com/embed/MmWWoMcGmo0"
      frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope;
      picture-in-picture" allowfullscreen></iframe>'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': '69225a1d-bd41-4167-9ae2-7a06fe0147df'
    'lead': 'The late night host got emotional as he revealed that his son William
      John Kimmel was born on April 21 with a serious heart issue. '
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:26:15.184+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T11:26:15.521+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Jimmy Kimmel tearfully reveals son''s health crisis'
    'visualType': 'embed'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3183f73c-98d8-4a5c-bf61-7251b6c89b71'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.522+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN) —</strong> Jimmy Kimmel used his monologue Monday
        night to get both personal and political.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'efe5d23f-c634-479e-a1f1-1abacce248b8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.522+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6b487bdf-7ed1-4a72-9c66-4e32536d9980'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.523+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The late night host got emotional as he revealed that his son William
        John Kimmel was born on April 21 with a serious heart issue. Those emotions
        then spilled into thoughts he offered about the importance of health coverage
        for people with pre-existing conditions and his feelings on health care policy.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '24c47042-31c6-46b0-8b56-f737f91ea507'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.523+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0849e5f6-4f95-41e6-bc4d-994a004a4da5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.523+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>During the 13-minute long monologue, Kimmel said his wife, Molly
        McNearney, had an easy delivery with their second child, whom they call "Billy."</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'faae4c60-a334-4dc8-9d89-fd17a8feeb1b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.184+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.524+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '40f78e49-cebc-4f6f-bb21-86fb3970d5af'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.524+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Six pushes, he was out," Kimmel said. "He appeared to be a healthy
        normal baby until about three hours after he was born."</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '529be21c-8713-4472-87ef-aef3ffe7f3ea'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.524+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '33d0cc16-854d-4c82-b0b2-7955e9d05bb1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.524+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Kimmel said his family was there in recovery at Cedars-Sinai Hospital
        as little Billy met his two-year-old sister, Jane.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ddb0714c-ab9f-4fce-a341-9e86fddf55e4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.525+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '26a76e0c-0556-4627-a24d-fe404ffc6a9e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.525+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Then "a very attentive nurse" discovered the baby had a heart murmur
        and appeared to be a bit purple in color.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'efb16586-0b65-4ef5-b586-90efdf323937'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.525+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e8a91cb6-1bf1-442f-ba24-7277321dbd4a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.525+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Tests showed the baby wasn''t getting enough oxygen into his blood.
        An X-ray ruled out an issue with Billy''s lungs, which meant there was a problem
        with the newborn''s heart, Kimmel said.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '77761481-11a2-44e5-b6c5-d7d2f7a46a31'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.526+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b08c974f-82ae-4960-9e88-df4451b2db57'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.526+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Immediately the room was flooded with doctors and machines, he recalled.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5db01c73-2503-4930-a1ff-ac4600f7a106'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.526+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9b9c95a1-4668-47b2-a057-50d026304521'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.185+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.527+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"It''s a terrifying thing," Kimmel said, his voice breaking. "You
        know, my wife is back in the recovery room, she has no idea what''s going
        on and I''m standing in the middle of a lot of worried looking people — kind
        of like right now — who were trying to figure out what the problem is."</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '92ed7971-f612-4f6d-b909-10e0714e0b1e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.527+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '91f2d507-3672-421a-a2d4-342505639f4e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.527+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Kimmel said a sonogram of the heart revealed the baby had been born
        with a heart condition in which a pulmonary valve was completely blocked and
        there was a hole in the wall between the left and right sides of his heart.</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e73b4ba5-3337-43d8-b116-dbd6e808960a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.527+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c3edf580-c3bf-46ca-9304-07dc681aa8f7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.528+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Three days later, Billy underwent open-heart surgery at Children''s
        Hospital Los Angeles.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '87cd6018-c1d3-45d1-bb51-347f2f388eb7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.528+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '83c23be6-3d2b-4150-94ed-592f1fee5b36'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.528+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"It was the longest three hours of my life," Kimmel said.</p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '80609df3-42a9-4bf0-87e4-eda0677a04bb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.528+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cb2c9dce-33f9-4dec-b730-a1112564a638'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.529+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The proud dad then showed a photo of his son hooked up to monitors
        and IVs after the procedure, and a picture of his son smiling a few days later.</p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'baa1e8e8-4283-424a-b984-dc5ef0349b7f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.529+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd26efd25-fcb0-45eb-8d77-2ec6a8c1c6cc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.529+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Kimmel joked, "Poor kid. Not only did he get a bad heart, he got
        my face."</p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'deb45a4b-c915-4243-be9d-f8e13fdffbde'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.186+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.529+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '49628fc3-07fd-423a-8299-8e93bb521746'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.530+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Billy will have to undergo future surgeries, but is doing well,
        according to Kimmel, who thanked a list of people, including medical professionals,
        his staff, friends and family.</p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7459a46b-6809-4d99-889a-83475d2c4eef'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.530+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '21ae2302-3eef-4b02-af85-dc396812ce23'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.530+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He also tweeted his thanks to well-wishers and those who donated
        to the hospital that treated Billy.</p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51d40a3e-f671-4f55-a762-730818a28e2a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.530+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9fa4845f-3f94-4031-a4fb-822f31710e01'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.531+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Kimmel also brought up President Donald Trump''s proposed $6 billion
        cut to budget for the National Institutes of Health, and praised Congress
        for deciding "to not go along with that."</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0d6fee72-8552-47ab-8d20-bee759a572c2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.531+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3b42d9a9-03a6-46a4-b00b-d4f331c69f68'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.531+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"They actually increased funding by $2 billion and I applaud them
        for doing that," Kimmel said.</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '64f69660-7d5c-43aa-8975-d62702254f5d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.531+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '594ddf78-32d5-40cc-a2c7-5758f2b8af48'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.532+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Such cuts would have adversely affected children, he said.</p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '75ab357d-94c4-40ad-9204-8c710511deab'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.532+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fe4ee205-a7e3-4f61-8d5b-33da0372c6c3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.187+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.532+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Kimmel also praised Obamacare and noted that, prior to it, those
        born with congenital heart issues like his son could be turned down for health
        insurance because they were deemed as having a pre-existing condition.</p>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '77222525-867d-498a-8df6-eecb42a392f5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.188+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.532+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f02f1213-08b7-477d-a791-8db9c568b7cc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.188+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.533+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>He urged Americans to come together and hold elected officials accountable
        for their decisions on health care, which he said is not a partisan issue.</p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2c2e67d1-6f10-4c8a-8d99-6d2fa96be3c1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.188+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.533+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1eaeef73-7374-458e-bbb6-f4845fac85bc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:26:15.188+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:26:15.533+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"If your baby is going to die and it doesn''t have to, it shouldn''t
        matter how much money you make," he said. "I think that''s something that
        whether you''re a Republican or a Democrat or something else, we all agree
        on that, right?"</p>'
  'North-Korea-US-provocation-bomber-drills':
    'author': 'James Griffiths and Barbara Starr, CNN'
    'categories': ['90febd36-3bb8-453a-86aa-322eeb5841f5']
    'created': 2017-05-03T08:33:00.025+08:00
    'imagesource': 'jcr:e7043506-b075-4c9f-abcc-e952e2c70def'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'e7171660-c47d-451a-936d-dbc7b0e1b39d'
    'lead': 'Pyongyang described the exercise, which involved two B1-B bombers, as
      as a "nuclear bomb-dropping drill" that made nuclear war more likely. North
      Korean state media described US President Donald Trump as a "warmonger".'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:28:37.401+08:00
