    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'North Korea accuses US of provocation after bomber drills'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e889a2f-a5cc-4cf0-aaff-1e9e2c99df1a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.660+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>(CNN) —</strong> North Korea has lashed out at the US after
        it conducted joint bomber drills with the South Korean air force, accusing
        it of reckless provocation.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cd8d8092-a476-4b96-a10c-4744b967f781'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.660+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '06a50c65-ae60-4ee4-9a30-b9284659d274'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.661+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Pyongyang described the exercise, which involved two B1-B bombers,
        as as a "nuclear bomb-dropping drill" that made nuclear war more likely. North
        Korean state media described US President Donald Trump as a "warmonger".</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '67b84dfe-7692-4255-967f-d8a282774b20'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.661+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '28b271e7-a55a-446c-b658-3d38ba019343'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.661+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The outburst came as the officials said that a controversial US
        missile defense system was up and running in South Korea -- albeit in a limited
        capacity. That announcement came a week before presidential elections in South
        Korea that are expected to bring in a government critical of the Terminal
        High Altitude Area Defense system, known as THAAD.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '974eaf32-a7be-46f7-b261-49580d8757ed'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.401+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.661+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '10a9cf99-afaf-47d0-8a1a-f9921cd9ab57'
      'mgnl:activationStatus': true
