      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The latest belligerent statement from Pyongyang was a response to
        the deployment of two US bombers over the Korean peninsula on Monday -- as
        part of a joint drill with South Korea and Japan''s air forces.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '70238798-4895-49d9-83ee-4396c5e783d4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.662+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '050aec65-84cc-42c1-9a56-b731fa81117e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.662+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>South Korean Defense Ministry spokesman Moon Sang-gyun told a briefing
        Tuesday that the deployment was part of an effort to "respond to North Korea''s
        nuclear missile threat and to deter North Korea''s provocations."</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f53311e4-f8fd-4d57-a2fa-51c1d61eb080'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.663+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '41b93ba4-a7b8-4629-9ce3-c949978faed8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.663+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>North Korean state news agency KCNA denounced the exercise in typically
        bombastic terms. "The reckless military provocation is pushing the situation
        on the Korean peninsula closer to the brink of nuclear war," KCNA said.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f15efd70-8a82-4ea0-977b-a2c2b23fdc58'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.663+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b79ecbef-4cf7-45b1-896a-b1364d38c8f3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.663+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>It claimed that "Trump and other US warmongers" were determined
        to make a preemptive nuclear strike on North Korea. Trump said on Monday that
        he might be willing to meet North Korean leader Kim Jong Un "under the right
        circumstances</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '940c5fe6-db7d-4b1e-92fa-9ef7afd9fdf1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.664+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8e0daf98-a658-453a-8ceb-93f05ab1f56a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.664+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>THAAD deployment</h2>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8236ead0-361b-4354-bf01-bf9db0aa23a9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.402+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.664+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The latest rhetorical tussle came amid increasing military activity
        around the Korean peninsula. A US official said the the THAAD missile system
        was now capable of shooting down a North Korean missile,although it was operating
        in a limited capacity. The official said thatthe US hopes to install additional
        units to increase coverage over South Korea.</p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c4b85fcd-20a7-4144-a383-8309e8fc117a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.665+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '31a85f8b-a8b9-4c1b-adc8-97090def64c9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.665+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>THAAD was deployed to South Korea by the US in response to North
        Korea''s increased missile and nuclear tests, but the defense system has drawn
        sharp opposition from China and Russia, whose territory is within the system''s
        range.</p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b538c7c5-44ed-4720-bf2e-77b25060df9b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.665+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f4f535e6-ba3c-414a-a959-eb96487de174'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.665+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>China again expressed its displeasure Tuesday, urging both sides
        to "stop the deployment immediately."</p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '33ca56df-3422-4ddb-a7b9-d66851ce68ad'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.666+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '64f2ce29-a287-4bae-a321-213d43ca2483'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.666+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"We will also firmly take necessary measures to safeguard our own
        interests," added Chinese Foreign Ministry spokesman Geng Shuang.</p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '27e6d39d-ff37-4abd-a310-395dbc03d0fb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.666+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f4c78059-daaf-4851-afb5-91999431fb5b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.667+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>THAAD is not expected to be fully operational until the end of the
        year, but US and South Korean officials publicly stressed the need to speed
        up the deployment of the technology as tensions mounted with Pyongyang.</p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '9c52cf29-9567-4a50-9e5c-fbfde8657d52'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.667+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ac91be99-4803-45b2-bc0a-62a870064262'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.667+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>South Korean Defense Ministry spokesman Moon Sang-kyun said at a
        briefing last week that equipment, including launchers, combat control stations
        and radar, had been deployed to the site in North Gyeongsang province and
        would be imminently operational.</p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8b7848d8-617b-40d1-bd9b-9d61c4811594'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.403+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.668+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3b78d1d7-e29b-4c9e-9420-e4db9d31ba81'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.668+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"These things are now in place, so you can connect them to get the
        operational capability from early on -- that''s what ''within days'' means,"
        he said.</p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6b5d1acd-824d-4835-8663-23d10cef55be'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.668+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b0fc35a3-7eec-464f-95b0-218904b9bab0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.668+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Political opposition</h2>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '80d52a30-6d9d-4774-9d43-c9ba390eefb5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.669+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Moon Jae-in, the frontrunner in South Korea''s Presidential election
        which takes place on May 9, has expressed skepticism over THAAD.</p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1a261a12-ddee-4029-a89d-a8f0bb9e22e8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.669+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4f0adc92-09b7-494a-b5ca-a6321de53358'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.669+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Throughout his campaign he''s called for its deployment to be decided
        by the next government.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '18a5099a-b5d2-48ed-a9ff-13fd262b450f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.669+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ef6d3626-a1a0-4f64-b7c0-c82a77c8266f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.670+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Speaking to South Korean radio station BBS FM on Tuesday, Moon said
        the deployment was "not a done deal yet," and should be based on public consultation
        and a vote in the country''s National Assembly.</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8c95f44d-95c7-470f-bc8f-b0e6fc71b5d5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.670+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '780e4cef-7f31-40e9-a53f-7ce4909a8abd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.670+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Moon''s Democratic Party is currently 20 points clear of its nearest
        rival, according to the most recent Gallup Korea daily opinion poll. Around
        40% of voters surveyed said they favored Moon, compared with 24% for centrist
        candidate Ahn Cheol-soo.</p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '408735ae-1504-4e77-990d-95bbed6ed759'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.404+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.671+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c42f015c-af4a-4b0e-ac32-fa3031425c83'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.671+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<h2>Defenses</h2>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '58f6a732-b315-4f06-8314-c43868aae80e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.671+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>THAAD is designed to shoot down short- and medium-range ballistic
        missiles in the latter stages of their flight as they plunge toward their
        targets.</p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '93c70c8d-7e57-4c12-a52b-cb638e4d783d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.671+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '06ed9e0a-d87e-4d82-9d07-acc8db70fce5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.672+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>While this means it cannot act against the type of intermediate-range
        missiles North Korea has been testing in recent months, THAAD also includes
        a sophisticated radar that will fit into an overlapping series of US missile
        defense systems, including Aegis warships operating in the Pacific and Patriot
        missile batteries deployed to Japan.</p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '86ef6c45-3983-4108-bc25-6ca091b0c6ac'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.672+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '43':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ce2b3662-d268-411c-a4fd-b572b7d3ffe6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.672+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The radar could provide critical early tracking data to these missile
        interception systems, as well as those protecting Guam, the closest US territory
        to North Korea.</p>'
    '44':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '773bc084-ee3f-4700-9a8c-08c8d5ae5d26'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:28:37.672+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '45':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '35089b50-9279-448d-929d-bff8c2d34eae'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:28:37.405+08:00
