      'mgnl:type': 'text'
      'text': '<p><em>This story was first published on CNN.com "<a href="https://edition.cnn.com/2017/05/02/asia/thaad-south-north-korea/index.html">North
        Korea accuses US of provocation after bomber drills</a>."</em></p>'
  'hillary-clinton-us-elections':
    'author': 'Dan Merica, CNN'
    'categories': ['90febd36-3bb8-453a-86aa-322eeb5841f5']
    'created': 2017-05-03T03:49:30.688+08:00
    'imagesource': 'jcr:c7bcc7d8-29da-4f38-b7a0-f97271b392b2'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'ecb022b0-4b65-4c3d-a984-911ab873e998'
    'lead': '"If the election had been on October 27, I would be your president,"
      she told CNN''s Christiane Amanpour at a Women for Women event in New York.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:31:13.035+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T11:31:13.545+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Clinton: ''If the election had been on October 27, I would be your president'''
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'de1ca7bb-162b-4aac-a801-4e773c4ad73c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.035+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.545+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>New York (CNN)</strong> — Hillary Clinton delivered her
        most forceful critique of President Donald Trump''s 2016 victory on Tuesday,
        taking personal responsibility for her failed campaign but also pointed to
        the timing of a letter from FBI Director James Comey and Russian interference
        as factors.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '23f07c13-ac9a-478a-90cc-48f631c5130b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.546+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ce80079b-8825-4fb7-be10-4053f6f6c596'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.546+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"If the election had been on October 27, I would be your president,"
        she told CNN''s Christiane Amanpour at a Women for Women event in New York.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0b325b63-ceb6-4103-8657-5e4723e97caf'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.546+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c786c80f-ea4f-494e-a6eb-8763ae702198'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.547+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I take absolute personal responsibility. I was the candidate, I
        was the person who was on the ballot. I am very aware of the challenges, the
        problems, the shortfalls that we had," Clinton said, before adding that she
        was "on the way to winning until a combination of Jim Comey''s letter on October
        28 and Russian WikiLeaks raised doubts in the minds of people who were inclined
        to vote for me and got scared off."</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bd87e66b-9dd1-468e-a94b-ec2768fae204'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.547+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b69052dd-eca8-4ca1-aed3-056bf6297e92'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.547+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton, who is currently writing a book that partly reflects on
        her 2016 loss, added, "The reason I believe we lost were the intervening events
        in the last 10 days."</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e3e6c2f2-ed89-4b15-9880-f57267060e1c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.547+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7a405172-8eca-4722-89ea-3781d1529b88'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.548+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The event marks the latest where Clinton, in a stinging rebuke to
        Trump, both blames herself for the 2016 loss but also casts the current President
        as someone aided by outside factors, including the Russian government.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '736f3529-057a-4d3c-b1d5-d3bf165347d3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.036+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.548+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'f290a43a-7d3e-4e21-81ae-de7d56b73d4a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.548+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>After Clinton noted the 3 million more votes she won than Trump,
        Amanpour joked that the President would soon tweet about the comment.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '40d79294-ad6a-4847-b38a-a0df86e2bdc7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.549+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c96c3a7c-1aec-43a1-ab6a-2a14023b51d5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.549+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Fine. Better than the interfering in foreign affairs," Clinton
        said. "If he wants to tweet about me than I am happy to be the diversion because
        we have lot of things to worry about. He should worry less about the election
        and my winning the popular vote than doing some other things that would be
        important for the country."</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '51ad7354-5d9a-4c04-a702-543d6db90421'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.549+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '47e5dfbb-8341-45ad-b14b-8bab9d528871'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.549+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton, aides and friends say, has grown more at peace with her
        loss in recent months, but is still focused on the interference by the Russian
        government, especially the fact that WikiLeaks began releasing John Podesta''s
        hacked emails hours after the damaging "Access Hollywood" Trump tape was released.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e7ad898-bc88-4a02-a3f8-fd24b85d7bcd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.550+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0ff4be5c-1ca5-4d6f-a739-0a4ce0d5280c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.550+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton, as she has done in the past, also hung part of her 2016
        loss on misogyny.</p>'
    '17':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '226eec1a-c7ad-44e3-a2c0-a081ab3ddacd'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.550+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '18':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '91c02a8d-512b-490a-9a4b-871e720bc9f7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.551+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Yes, I do think it played a role. I think other things did as well,"
        Clinton said.</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1c7f1035-69c7-471f-b4f5-2bb405cd9363'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.551+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '20':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'fa12c383-c1df-4025-aabc-39d685d3a950'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.037+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.551+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>But repeatedly, Clinton came back to Russian President Vladimir
        Putin''s role in the 2016 election and how he was able to tilt the scale in
        favor of Trump and against her.</p>'
    '21':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4a0abc6e-1a57-4b59-994f-8a4112ddb1e9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.551+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '22':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '48bc98ac-1dd1-42e1-8490-50cc6b5a267f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.552+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton, aides say, sees her role during the Trump years as a political
        activist who speaks out when issue she cares about are threatened. And on
        Tuesday, it was clear Clinton was ready to settle into that role.</p>'
    '23':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '05f4257a-b777-43dd-925a-cab1943a9593'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.552+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '24':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c25eb10a-44f4-4316-890f-03ecbdeffeb1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.552+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I am now back to being an activist citizen and part of the resistance,"
        Clinton said, drawing cheers from the crowd that included former aides, donors
        and celebrities like actress Meryl Streep.</p>'
    '25':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4cdbf857-e9ac-41d3-8e67-75dc8c99091b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.553+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '26':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a698dad9-d20d-4b15-bf79-bc7439626103'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.553+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The former secretary of state also pledged to "publicly request"
        that the Trump administration "not end our efforts making women''s rights
        and opportunities" central to US policy.</p>'
    '27':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7ebd7d22-8c4a-432d-884c-50e493246b4e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.553+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '28':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '78d0ad8e-a73c-4630-a5ac-ba141e0661cb'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.553+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton praised Defense Secretary James Mattis for making the case
        for maintaining US foreign aid funding, despite a budget request by Trump
        that would cut it.</p>'
    '29':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b98bfd6a-b02b-4905-8753-13b3a1d5d8af'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.554+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '30':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1e60e1d6-66e0-43d9-8200-09261ebaa8a0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.554+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I am hoping that because of voices like Jim Mattis and others that
        that will begin to influence the administration," she said.</p>'
    '31':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'accdebba-6982-4d37-8240-a5ea5ea9bf0c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.554+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '32':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '01f4aba9-e8a1-42ac-bd5f-bd69468f02e8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.038+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.554+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>And on North Korea, Clinton cautioned Trump against giving too much
        away by saying he would meet with North Korean leader Kim Jung Un under the
        right circumstances.</p>'
    '33':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b1782863-b7e1-4718-861a-06f655b94d80'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.555+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '34':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '917db05a-2a8c-40a8-ab4c-00e23527df81'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.555+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"I don''t believe that we alone are able to really put the pressure
        on this North Korean regime that needs to be placed," she said. "Now the North
        Koreans are always interested ... in trying to get Americans to try to come
        to negotiate to elevate their status and their position and we should be very
        careful about giving that way."</p>'
    '35':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1f73971d-55fd-4039-a6ee-b8c106072510'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.555+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '36':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '15eb2365-e0f5-48d2-a7fc-eea3dbe26c10'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.556+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton said such negotiations could make it harder to work out
        a solution with countries in the region.</p>'
    '37':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ab96c2ff-f701-4d88-b1a6-813fbaa45b9e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.556+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '38':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '70875ede-d605-479b-8f68-226c33b2de69'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.556+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Clinton will also speak on Tuesday at a Planned Parenthood 100-year
        anniversary gala, where she is expected to slam Trump''s handling of women
        health issues during his first months in office, including attempts to defund
        the women''s health organization.</p>'
    '39':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '91f13de9-7595-4d48-b691-10f427ecb4e7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.556+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '40':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3797dad0-a00a-4ce8-a387-188f4b10732f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.557+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Planned Parenthood has been vocal in their opposition to Trump,
        slamming many of his appointees and the Republican plan to defund the organization.</p>'
    '41':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '44dbd1c5-ea34-4d60-a231-925c9faca33d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.557+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '42':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8b2fd7fb-0e2e-418f-85c5-8e1e6d632641'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.557+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Both venues offer Clinton the opportunity to comment on Trump''s
        first 100 days in office and organizers at Planned Parenthood expect the 45th
        President will come up in the former Democratic nominee''s speech.</p>'
    '43':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd2dcf2e7-fe2b-4082-910e-bedb39429956'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.039+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.557+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '44':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a423f268-da75-44d8-aae4-331c6ce604e9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.558+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Since spending months out of the limelight after the 2016 campaign,
        Clinton has re-emerged onto the public stage as the Republican Party grapples
        with Trump and the Democratic Party searches for a leader.</p>'
    '45':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '87c1f952-96dc-4c11-9cc1-390c621218c8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.558+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '46':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cd45ae0f-b916-404f-9533-09f0bd78cb8b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.558+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In a series of speeches, Clinton has shown a willingness to knock
        the President, as was on display at Tuesday''s interview.</p>'
    '47':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e2db11da-2d48-4507-9bd5-0ed7a26349c6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.559+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '48':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5bb74de7-c27f-42d7-9920-ed70f1df5206'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.559+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>In March, Clinton called the Trump-backed health care bill "disastrous"
        and knocked the plan for doing away with a maternity care requirement in health
        care.</p>'
    '49':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '0a56785e-25ae-46de-b324-bcaffb28b959'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.559+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '50':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '939ce2fb-1167-495b-81e9-283451bf440a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.559+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Really? Take away maternity care?" Clinton said during her keynote
        address at the annual conference hosted by the Professional BusinessWomen
        of California. "Who do these people talk to?"</p>'
    '51':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd086bfea-bd6d-4a26-a913-03846607bd87'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.560+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '52':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'a246cb68-1cd7-46c3-874f-9a21bfb8d7aa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.560+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>And in April, Clinton told another group of women that she is "deeply
        concerned" with how Russia meddled into the 2016 election.</p>'
    '53':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2d3b05d1-d30a-46bf-a8b5-fa528c6c9323'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.560+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '54':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '24117785-2300-4290-84b9-f9d1e0bf662c'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.040+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.560+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"A foreign power meddled with our election and did so in a way that
        we are learning more about every single day," she said.</p>'
    '55':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8f2d3954-66ca-4e8d-bf84-142d57a3a962'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.561+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '56':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2fa4941d-08aa-48e8-a4b3-957b9448bc10'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.561+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>She also added that it was "somewhat gratifying" to see Trump mystified
        about how complex health care is.</p>'
    '57':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bc3ac122-fe2b-4dda-a967-b99ae8aee398'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.561+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '58':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '23b90184-1632-4719-8ebe-a2831cb922a0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.562+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"You know, health care is complicated. Right?" Clinton said in a
        jab at Trump. "That was somewhat gratifying."</p>'
    '59':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '4ae009b9-1104-4672-b3af-31694776be53'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.562+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '60':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '06a54f4d-c010-42f8-811b-b11be1d4008a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.562+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The small group of aides who are still in regular contact with Clinton
        stress, though, that the recent uptick in Trump criticism does not mean the
        former secretary of state is on a comeback. Clinton, they say, has remained
        in touch with an array of groups and while it may appear she is growing more
        political, the speeches don''t foretell a more forceful jump back into the
        political fray.</p>'
    '61':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '341c17a6-f18c-4de1-8320-5d28770cf6dc'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.562+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '62':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '7cff1db9-a704-4385-87ae-dfa7df6f4e44'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.563+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The aides say that Clinton will knock the Trump administration when
        she sees fit — as evidenced by an April broadside against White House press
        secretary Sean Spicer after he chided a black female journalist for shaking
        her head at a news conference.</p>'
    '63':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3cb23dbc-9cb9-4b13-82b9-aa365ae3adf8'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.563+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '64':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'dccb17ba-2f75-4dff-8ac5-918b84b83cc5'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.563+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Too many women have had a lifetime of practice taking this kind
        of indignity in stride," Clinton said.</p>'
    '65':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2fbc97fe-1196-42e7-8c41-ee35a6d0fb7b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.564+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '66':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c6f93f73-9cec-4f0f-80d9-0169a47a9cee'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.041+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:31:13.564+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>But they say the former secretary of state is more interested in
        helping the Democratic Party in 2018 and beyond then resuscitating her own
        political career.</p>'
    '67':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'cc6d1448-95be-495c-9890-6cfa6e5484b2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:31:13.042+08:00
