      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><em>CNN''s Jeff Zeleny contributed to this report.</em></p>'
    '69':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '60027d90-8fa9-4889-bc25-f9755788955a'
