  'LTFRB-still-unclear-on-cause-of-Nueva-Ecija-bus-crash':
    'author': 'Makoi Popioco, CNN Philippines'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T02:16:07.410+08:00
    'imagesource': 'jcr:8d665fb7-0caf-4d47-895b-7fb601b84bd1'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'd74ea27d-0de0-4923-a068-d603cb85b43e'
    'lead': 'While survivors consistently point the finger at the brake, the LTFRB
      said during yesterday''s hearing that there were many other lapses on the part
      of bus company LeoMarick Trans.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:33:48.458+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T11:33:48.681+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'LTFRB still unclear on cause of Nueva Ecija bus crash'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c9d4116f-17aa-4ea2-a748-08238ced144b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.458+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.682+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 3) —</strong> Transport
        regulators are still looking into possible causes that led to a tragic bus
        trip in Nueva Ecija which killed 34 people two weeks ago.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '6b42dcb6-6548-4084-9df9-7f8e9bbb56e1'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.458+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.682+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '41d042ad-2272-4c93-a07f-610acc6b902a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.458+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.683+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Earlier investigation by the Nueva Ecija police showed the driver
        lost control of the bus when the right front wheel burst, which led to the
        bus plunge into a ravine.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '2d75514d-61a4-47e1-95f7-473c98796721'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.683+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '051df827-9c3e-45a4-9928-916bea466008'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.683+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="http://cnnphilippines.com/news/2017/05/03/bit.ly/2peW17U"><strong>READ:
        At least 33 killed in Nueva Ecija bus crash</strong></a></p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '8248bb3d-9907-4b1b-97fe-6ccbccd6fec4'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.684+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'dd95c2d7-a057-4679-a4b7-018889f7fe86'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.684+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>While survivors consistently point the finger at the brake, the  Land
        Transportation and Franchising Regulatory Board (LTFRB) said during yesterday''s
        hearing that there were many other lapses on the part of bus company LeoMarick
        Trans.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b80659bd-0cb8-4841-95e3-d4fb3278bb24'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.684+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '56418650-46c6-4175-bb78-b3d9bc931ea6'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.684+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Bus company operator Leonardo Patulot said the unit was bought in
        2006. However, LTFRB found out the bus'' engine was manufactured in 1984,
        making it over 30 years old.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b9a089fd-447d-4222-9000-ab1afee82db0'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.685+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e4ad5709-bb1c-44ad-a23e-16ac48d167e2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.685+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Patulot also said Rolando Mangaoang, the driver who was among those
        killed in the mishap, had worked for them for around eight years. Despite
        minor accidents, he said Mangaoag was among their most cautious drivers.</p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '14b94f6b-a4b4-4461-8e4a-99ad9fda7ea7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.685+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c9b3daa6-5982-4694-86df-906e6504f288'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.459+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.686+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Mangaoang was the only driver in the bus for the 15-hour trip from
        Ilagan, Isabela to Candon, Ilocos Sur. He was supposed to have a reliever.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'e5f04a2b-2516-4175-b21a-59c98ff7a63a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.460+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.686+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '3d43e6d0-8683-41dd-8dad-4a467aea1280'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.460+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.686+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Sa bawat isang bus po kasi na tumatakbo sa company namin, may dalawa
        po, may spare na isa… Nagkataon lang na bumaba siya," Patulot told LTFRB.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b64126c8-2c65-4600-8587-3ea63756793e'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.460+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.686+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '68377592-f755-4240-ad97-30d64ff8a4c7'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:33:48.460+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:33:48.687+08:00
