      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Another angle being looked into was overloading, as police estimate
        77 people were on the bus, including about 15 teenagers. The bus only had
        a seating capacity of 45.</p>'
    '19':
      'jcr:primaryType': 'mgnl:block'
