      'text': '<p>The next hearing will be on May 30 where LeoMarick Trans should
        submit its maintenance records before the crash.</p>'
  'Senate-bill-update-Revised-Penal-Code':
    'author': 'CNN Philippines Staff'
    'caption': 'Bill sponsor and author, Senate Minority Leader Franklin Drilon'
    'categories': ['b3b3f789-2fc8-49bd-8c51-bc446e3087d9']
    'created': 2017-05-03T00:53:39.114+08:00
    'imagesource': 'jcr:67bf7d29-77d0-4c6f-8cc1-c6c5620b6784'
    'jcr:primaryType': 'mgnl:composition'
    'jcr:uuid': 'e926a76a-c2ca-4b9c-9896-ab4fe9e856de'
    'lead': 'Fresh from a Lenten break, the Senate passed today on third and final
      reading a bill which seeks to update the penalties for certain crimes as contained
      in the Revised Penal Code — which was enacted almost nine decades ago.'
    'mgnl:activationStatus': true
    'mgnl:created': 2019-07-17T11:36:22.051+08:00
    'mgnl:createdBy': 'eunice'
    'mgnl:lastActivated': 2019-07-17T11:36:22.229+08:00
    'mgnl:lastActivatedBy': 'eunice'
    'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
    'mgnl:lastModifiedBy': 'magnolia'
    'template': '1'
    'title': 'Senate passes bill updating old Revised Penal Code'
    'visualType': 'image'
    '0':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c5c05f66-043e-4c9b-9369-b76fe170b617'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.051+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.230+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><strong>Metro Manila (CNN Philippines, May 2)</strong> — Fresh from
        a Lenten break, the Senate passed today on third and final reading a bill
        which seeks to update the penalties for certain crimes as contained in the
        Revised Penal Code — which was enacted almost nine decades ago.</p>'
    '1':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ea93c460-954d-47ec-8907-a508d0890d38'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.051+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.230+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '2':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '90038190-b114-4e34-ab3f-d5834310c542'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.051+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.230+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Senate Bill No. 14 seeks to address the "outdated" penalties which
        were based on the economic conditions 87 years ago, or in 1930 when the Revised
        Penal Code came into effect.</p>'
    '3':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'b94b4f64-1d73-4e76-b3c7-783125b9410a'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.231+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '4':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ff1969df-40ba-4f3b-9153-1cab03d38c0d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.231+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Bill sponsor and author, Senate Minority Leader Franklin Drilon,
        cited that a person found guilty of estafa involving an amount of P250 would
        currently be jailed for up to two years and four months. Under the proposed
        measure, this will be reduced to four months.</p>'
    '5':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '02d7848a-eefc-4ad8-b93f-211ccdf07dc3'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.231+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '6':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'c904fcd0-02c9-45dd-8e2c-f2b1b43abb7d'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.232+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The amount of fines had also been adjusted. High crimes, such as
        rebellion and treason, will be have fines of ₱4M and  ₱1.6M, respectively
        — from the old amount of ₱20,000 and ₱8,000.</p>'
    '7':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '5a363f7c-a741-4625-8e6a-e961cac25718'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.232+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '8':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '04632afd-7204-4f27-8582-1413170f9364'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.232+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The bill also seeks to update penalties for maltreatment of prisoners,
        unlawful arrest and indirect assault from ₱500 to ₱100,000 while penalties
        for falsification of documents will be increased from ₱5,000 to ₱1M.</p>'
    '9':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '53356696-5034-48b3-8c99-e38f5bad9d8b'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.232+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '10':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '1876fae8-46db-4391-a859-5ea6500e5730'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.233+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p><a href="https://cnnphilippines.com/news/2017/05/02/senate-passes-mental-health-act-third-reading.html"><strong>Related:
        Senate passes Mental Health Act</strong></a></p>'
    '11':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '94bd3f40-e975-41a5-a754-925101ec515f'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.233+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '12':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'ff1687ec-1d33-4d94-af7b-688a857d7bf2'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.052+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.233+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>The bill, co-authored by Sen. Leila de Lima and co-sponsored by
        Sen. Richard Gordon, was approved with 21 affirmative votes, zero negative
        vote and no abstention.</p>'
    '13':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'aff3c60d-ddf1-4231-a4eb-fa5b80af6900'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.053+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.234+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '14':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'd57bd7e4-bd74-4f24-a32f-626a714066c9'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.053+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.234+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>Drilon said the proposed measure would have a retroactive effect,
        and was expected to benefit about 54,189 mostly poor inmates.</p>'
    '15':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': 'bdcb45ec-6f53-476e-95e9-a38f55bb18fa'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.053+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.234+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>

        </p>'
    '16':
      'jcr:primaryType': 'mgnl:block'
      'jcr:uuid': '091f833d-c56c-4e2c-9485-a031bd815838'
      'mgnl:activationStatus': true
      'mgnl:created': 2019-07-17T11:36:22.053+08:00
      'mgnl:createdBy': 'eunice'
      'mgnl:lastActivated': 2019-07-17T11:36:22.234+08:00
      'mgnl:lastActivatedBy': 'eunice'
      'mgnl:lastModified': 2024-07-05T12:22:54.920+08:00
      'mgnl:lastModifiedBy': 'magnolia'
      'mgnl:type': 'text'
      'text': '<p>"Not that they will be immediately released, but their sentences
        will be equitably reduced, corresponding to today''s value of the property
        stolen, not the values set in 1930," he stressed. "We truly believe that the
        threat of injustice created by an outdated instrument of justice is real,
        and thus requires immediate legislative action."</p>'
